8e\": \"tbd.\"}',1,'2023-11-20 09:57:48','2023-11-20 09:57:48','6f4f74af-d2ca-4e12-9b3b-5fcb4ec2a202'),(373,152,3,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Nestled along the banks of the Elbe River in northern Germany, Hamburg stands as a vibrant and historic metropolis, beckoning visitors with its rich maritime heritage and contemporary urban allure. As the country\'s second-largest city and its principal port, Hamburg has long been a pivotal economic and cultural hub. The cityscape is defined by an eclectic mix of architectural styles, from the medieval charm of the Speicherstadt, the world\'s largest warehouse complex, to the sleek modernity of the HafenCity district, showcasing the dynamic evolution of Hamburg over the centuries. The bustling port activities contribute to the city\'s cosmopolitan atmosphere, attracting a diverse population and fostering a global perspective that is evident in its lively cultural scene and gastronomic offerings.\\n\\nHamburg\'s cultural tapestry is woven with an array of museums, theaters, and music venues, making it a haven for art enthusiasts and music lovers alike. The iconic Elbphilharmonie, a modern masterpiece perched atop an old warehouse, stands as a testament to the city\'s commitment to blending tradition with innovation. Beyond its cultural richness, Hamburg\'s green spaces, such as the expansive Planten un Blomen park and the picturesque Alster Lake, provide residents and visitors alike with tranquil retreats within the heart of this dynamic urban landscape. Whether exploring historic landmarks, savoring local delicacies in the bustling markets, or cruising along the picturesque canals, Hamburg beckons with a unique blend of old-world charm and contemporary vibrancy.\"}',1,'2023-11-20 09:57:59','2023-11-20 09:57:59','43204196-5d05-44d6-a9f4-a62b1897e8ca'),(374,152,4,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"An den Ufern der Elbe in Norddeutschland gelegen, ist Hamburg eine pulsierende und historische Metropole, die Besucher mit ihrem reichen maritimen Erbe und ihrem modernen urbanen Charme anzieht. Als zweitgrte Stadt des Landes und wichtigster Hafen ist Hamburg seit langem ein wichtiger wirtschaftlicher und kultureller Knotenpunkt. Das Stadtbild wird von einem eklektischen Mix aus verschiedenen architektonischen Stilen geprgt, vom mittelalterlichen Charme der Speicherstadt, dem grten Lagerhauskomplex der Welt, bis hin zur eleganten Modernitt der HafenCity, die die dynamische Entwicklung Hamburgs im Laufe der Jahrhunderte widerspiegelt. Die geschftigen Hafenaktivitten tragen zur kosmopolitischen Atmosphre der Stadt bei, die eine vielfltige Bevlkerung anzieht und eine globale Perspektive frdert, die sich in der lebendigen Kulturszene und dem gastronomischen Angebot widerspiegelt.\\n\\nHamburgs kultureller Teppich ist mit einer Vielzahl von Museen, Theatern und Musikveranstaltungen gespickt, was die Stadt zu einem Paradies fr Kunst- und Musikliebhaber macht. Die ikonische Elbphilharmonie, ein modernes Meisterwerk, das auf einem alten Lagerhaus thront, ist ein Zeugnis fr das Engagement der Stadt, Tradition und Innovation zu verbinden. Neben dem kulturellen Reichtum bieten Hamburgs Grnflchen, wie der weitlufige Park Planten un Blomen und die malerische Alster, Einwohnern und Besuchern gleichermaen ruhige Rckzugsorte inmitten dieser dynamischen Stadtlandschaft. Ob bei der Erkundung historischer Wahrzeichen, beim Genuss lokaler Kstlichkeiten auf den belebten Mrkten oder bei einer Schifffahrt auf den malerischen Kanlen - Hamburg lockt mit einer einzigartigen Mischung aus altem Charme und moderner Lebendigkeit.\"}',1,'2023-11-20 09:57:59','2023-11-20 09:57:59','f7b7061d-d1aa-472a-96f8-7b76c96115f0'),(463,23,5,'Example 59',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-20 10:24:47','2023-11-20 10:24:47','90851689-f7a0-4dd2-95fe-0b98ededb1bc'),(465,25,5,'Example 61',NULL,