,'2023-11-23 23:36:16','4f413ebc-6094-4703-bf31-350f31cb14a4'),(2299,571,9,'Munich 2656428 1920',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-23 23:36:16','2023-11-23 23:36:16','f98d85a7-5a62-40b9-8873-c5f1f7697c3a'),(2300,571,5,'Munich 2656428 1920',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-23 23:36:16','2023-11-23 23:36:16','a2f10d43-1b44-48e8-b3ea-ca7e5285e597'),(2337,584,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Nestled in the heart of Bavaria, Munich stands as a cultural jewel, seamlessly weaving together centuries-old traditions with a contemporary vibrancy that captivates both locals and visitors alike. From its iconic architecture to the lively beer gardens, Munich offers a unique blend of history, culture, and festive revelry.\\n\\nMunich\'s skyline is a testament to its rich history and commitment to preserving architectural heritage. The resplendent Nymphenburg Palace, with its rococo facades and lush gardens, transports visitors to an era of Bavarian royalty. The towering spires of Frauenkirche dominate the cityscape, symbolizing both faith and resilience. Wander through the city\'s charming streets, where each corner tells a story of Bavarian elegance and grandeur.\\n\\nMunich boasts a cultural scene that rivals the best in Europe. Art enthusiasts can lose themselves in the Alte Pinakothek, home to masterpieces by the likes of Albrecht Drer and Rembrandt. The Pinakothek der Moderne, on the other hand, embraces contemporary art in all its forms. The city\'s theaters and concert halls, including the renowned National Theatre and the Gasteig, showcase performances that range from classical masterpieces to avant-garde productions.\"}',1,'2023-11-23 23:37:41','2023-11-23 23:37:41','2196a7a9-d1a7-4e64-8e0c-c36c7a6b1a2a'),(2338,584,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Im Herzen Bayerns gelegen, ist Mnchen ein kulturelles Juwel, das jahrhundertealte Traditionen nahtlos mit einer modernen Lebendigkeit verbindet, die Einheimische und Besucher gleichermaen in ihren Bann zieht. Von der ikonischen Architektur bis hin zu den lebhaften Biergrten bietet Mnchen eine einzigartige Mischung aus Geschichte, Kultur und festlicher Ausgelassenheit.\\n\\nMnchens Skyline ist ein Zeugnis seiner reichen Geschichte und seines Engagements fr die Bewahrung des architektonischen Erbes. Das prchtige Schloss Nymphenburg mit seinen Rokokofassaden und ppigen Grten versetzt die Besucher in die Zeit der bayerischen Knige. Die hoch aufragenden Trme der Frauenkirche dominieren das Stadtbild und symbolisieren sowohl Glauben als auch Widerstandskraft. Schlendern Sie durch die charmanten Straen der Stadt, wo jede Ecke eine Geschichte von bayerischer Eleganz und Pracht erzhlt.\\n\\nMnchen hat eine Kulturszene, die sich mit den besten Europas messen kann. Kunstliebhaber knnen sich in der Alten Pinakothek verlieren, die Meisterwerke von Albrecht Drer und Rembrandt beherbergt. Die Pinakothek der Moderne hingegen widmet sich der zeitgenssischen Kunst in all ihren Formen. Die Theater und Konzerthuser der Stadt, darunter das renommierte Nationaltheater und der Gasteig, zeigen Auffhrungen, die von klassischen Meisterwerken bis hin zu Avantgarde-Produktionen reichen.\"}',1,'2023-11-23 23:37:41','2023-11-23 23:37:41','0cf3290b-9c7c-4e81-8908-a3006874561b'),(2339,584,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Situata nel cuore della Baviera, Monaco di Baviera  un gioiello culturale che intreccia perfettamente tradizioni secolari con una vivacit contemporanea che affascina sia gli abitanti che i visitatori. Dalla sua architettura iconica alle vivaci birrerie all\'aperto, Monaco offre una miscela unica di storia, cultura e festa.\\n\\nLo skyline di Monaco di Baviera  una testimonianza della sua ricca storia e del suo impegno nel preservare il patrimonio architettonico. Lo splendido Palazzo di Nymphenburg, con le sue facciate rococ e i suoi giardini lussureggianti, trasporta i visitatori in un\'epoca di regalit bavarese. Le guglie svettanti della Frauenkirche dominano il paesaggio urbano, simboleggiando sia la fede che la resistenza. Passeggiate per le affascinanti strade della citt, dove ogni angolo racconta una storia di eleganza e grandezza bavarese.\\n\\nMonaco vanta una scena culturale che rivaleggia con le migliori d\'Europa. Gli appassionati d\'arte possono perdersi nella Alte Pinakothek, che ospita capolavori di Albrecht Drer e Rembrandt. La Pinakothek der Moderne, invece, abbraccia l\'arte contemporanea in tutte le sue forme. I teatri e le sale da concerto della citt, tra cui il rinomato Teatro Nazionale e il Gasteig, ospitano spettacoli che spaziano dai capolavori classici alle produzioni d\'avanguardia.\"}',1,'2023-11-23 23:37:41','2023-11-23 23:37:41','c00f57ce-c863-4a79-a0c9-13dd46491d28'),(2372,594,6,'Frauenkriche Muenchen Alpen 1920x9601',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-23 23:52:19','2023-11-23 23:52:19','68242950-bdc7-4d01-a8de-b3ffb79536da'),(2373,594,2,'Frauenkriche Muenchen Alpen 1920x9601',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-23 23:52:19','2023-11-23 23:52:19','d244d014-6870-40e6-9673-5aa638d780e1'),(2374,594,1,'Frauenkriche Muenchen Alpen 1920x9601',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-23 23:52:19','2023-11-23 23:52:19','89e76463-afb6-4f3d-9548-4b0813888ee9'),(2375,594,4,'Frauenkriche Muenchen Alpen 1920x9601',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-23 23:52:19','2023-11-23 23:52:19','a6837f9b-b6d8-4186-b537-1ac0bd35a61