nden-eine-symphonie-aus-geschichte-und-moderne','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-11-25 12:25:00','2023-11-25 12:26:22','6b0c2e5c-37af-4af8-954f-678156cb12ba'),(2523,620,1,'Exploring Berlin: A Symphony of History and Modernity','exploring-berlin-a-symphony-of-history-and-modernity','articles/exploring-berlin-a-symphony-of-history-and-modernity','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-11-25 12:25:00','2023-11-25 12:26:14','5de9ecc5-374a-4eb0-a665-1eceae9d9194'),(2530,624,2,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Berlin, die pulsierende Hauptstadt Deutschlands, verbindet mhelos eine reiche Geschichte mit einer modernen, dynamischen Energie, die jeden Reisenden, der das Glck hat, durch ihre Straen zu wandern, in ihren Bann zieht. Nach einer turbulenten Vergangenheit hat sich Berlin zu einer Stadt entwickelt, die Widerstandsfhigkeit, Vielfalt und Kreativitt zelebriert. Von historischen Wahrzeichen bis hin zu pulsierenden Szenevierteln ist Berlin ein fesselndes Reiseziel, das eine unvergessliche Reise verspricht.\\n\\nBeginnen Sie Ihre Erkundungstour am Brandenburger Tor, dem Wahrzeichen der deutschen Wiedervereinigung. Dieses majesttische neoklassizistische Monument steht stolz im Herzen der Stadt und bildet das Tor zu Unter den Linden, einem historischen Boulevard, der von Museen, Palsten und charmanten Cafs gesumt ist. Schlendern Sie zu verschiedenen Tageszeiten durch das Brandenburger Tor und erleben Sie seine verwandelnde Schnheit - im warmen Licht des Sonnenaufgangs oder im Licht des Nachthimmels erweckt es immer wieder ein Gefhl der Ehrfurcht.\\n\\nTauchen Sie in die komplexe Geschichte Berlins ein, indem Sie die East Side Gallery besuchen, einen lebendigen Abschnitt der Berliner Mauer, der mit ber hundert Wandmalereien von Knstlern aus aller Welt geschmckt ist. Jedes Wandbild erzhlt eine eigene Geschichte und spiegelt die Hoffnung, die Kmpfe und die Triumphe einer Stadt wider, die einst geteilt war. Bei einem Spaziergang durch diese Open-Air-Galerie werden Sie das Echo der Vergangenheit und den unverwstlichen Geist spren, der Berlin heute prgt.\"}',1,'2023-11-25 12:25:31','2023-11-25 12:25:31','1cc1ef47-d81f-4601-89d7-f91ba62ecad0'),(2531,624,1,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Berlin, the vibrant capital of Germany, effortlessly blends a rich tapestry of history with a modern, dynamic energy that captivates every traveler lucky enough to wander its streets. Steeped in a tumultuous past, Berlin has emerged as a city that celebrates resilience, diversity, and creativity. From iconic historical landmarks to trendy neighborhoods pulsating with life, Berlin is a captivating destination that promises an unforgettable journey.\\n\\nBegin your exploration at the iconic Brandenburg Gate, an enduring symbol of German reunification. This majestic neoclassical monument stands proudly at the heart of the city, providing a gateway to Unter den Linden, a historic boulevard lined with museums, palaces, and charming cafes. Wander through the Brandenburg Gate at different times of the day to witness its transformative beauty  bathed in the warm glow of sunrise or illuminated against the night sky, it never fails to evoke a sense of awe.\\n\\nDelve into Berlin\'s complex history with a visit to the East Side Gallery, a vibrant stretch of the Berlin Wall adorned with over a hundred murals by artists from around the world. Each mural tells a unique story, reflecting the hope, struggles, and triumphs of a city that once stood divided. As you stroll along this open-air gallery, you\'ll feel the echoes of the past and the resilient spirit that now defines Berlin.\"}',1,'2023-11-25 12:25:31','2023-11-25 12:25:31','dc575482-b772-4092-95cc-dbc0f033a251'),(2532,625,6,'Blue hour 3848856 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-25 12:26:47','2023-11-25 12:26:47','4fb6681