iner Nachtleben bietet fr jeden Geschmack etwas.\\n\\nBerlin, mit seiner Dichotomie aus Geschichte und Moderne, verspricht eine einzigartige und bereichernde Reiseerfahrung. Ganz gleich, ob Sie von den ikonischen Wahrzeichen der Stadt fasziniert sind, sich fr ihre komplexe Geschichte interessieren oder sich von ihrem modernen Charme verzaubern lassen - Berlin ldt Sie ein, eine Stadt zu erkunden, die sich ihrer Vergangenheit stellt und gleichzeitig die Zukunft mit offenen Armen empfngt.\"}',1,'2023-11-26 12:40:42','2023-11-26 12:40:42','07164bfb-d937-4ede-aa8b-b1736faaf37c'),(2847,698,1,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"For a taste of the city\'s modern vibrancy, head to Kreuzberg. This eclectic neighborhood is a melting pot of cultures, boasting a diverse culinary scene, trendy boutiques, and a thriving arts community. Explore Grlitzer Park, where locals gather to enjoy picnics and live music, or lose yourself in the vibrant street art that adorns every corner. Kreuzberg is a testament to Berlin\'s ability to seamlessly blend its storied past with a progressive, forward-thinking present.\\n\\nIn the evening, savor Berlin\'s legendary nightlife. From techno temples like Berghain to intimate jazz clubs and historic beer gardens, the city comes alive after dark. Immerse yourself in the pulsating beats of the electronic music scene or unwind in a cozy bar with a craft beer in hand  Berlin\'s nightlife caters to every taste.\\n\\nBerlin, with its dichotomy of history and modernity, promises a unique and enriching travel experience. Whether you\'re captivated by its iconic landmarks, intrigued by its complex history, or enchanted by its contemporary charm, Berlin invites you to explore a city that has embraced its past while embracing the future with open arms.\"}',1,'2023-11-26 12:40:42','2023-11-26 12:40:42','c4d05f27-aec5-4cad-95a4-846c7d4314d2'),(2912,728,6,'Munich 3909108 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\",