oniosa miscela di tradizione, cultura e allegria festosa. Unitevi a noi per esplorare gli angoli e le fessure di questo arazzo bavarese, dove ogni momento  una celebrazione del fascino senza tempo di Monaco. Prost! \"}',1,'2023-11-26 12:48:16','2024-03-26 11:00:22','91e7466d-77d0-438a-9f8d-4dffe35e2364'),(2943,736,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Mnchen ist ein Synonym fr das Oktoberfest, das grte Volksfest der Welt, das jedes Jahr Millionen von Besuchern anlockt. Die Stadt verwandelt sich in ein lebendiges Fest der bayerischen Kultur, mit traditioneller Musik, kstlicher Kche und natrlich dem besten Bier. ber das Oktoberfest hinaus bieten Mnchens Biergrten wie das berhmte Hofbruhaus eine authentische Verkostung der einheimischen Biere und eine gesellige Atmosphre, die die bayerische Lebensart ausmacht.\\n\\nDie kulinarische Landschaft Mnchens ist ein gastronomisches Abenteuer, bei dem traditionelle bayerische Gerichte durch internationale Einflsse ergnzt werden. Von den deftigen Wrstchen auf dem Viktualienmarkt bis hin zu den Michelin-Sternerestaurants bietet die Stadt alles, was das Herz begehrt. Verpassen Sie nicht die Gelegenheit, eine Brezn zu probieren oder sich ein Stck Apfelstrudel zu gnnen, whrend Sie die Stadt erkunden.\\n\\nIn Mnchen verschmelzen Vergangenheit und Gegenwart und schaffen eine Atmosphre, die sowohl bezaubernd als auch dynamisch ist. Ob Sie ber historische Pltze schlendern, in kulturelle Schtze eintauchen oder in einem belebten Biergarten einen Krug heben - Mnchen ldt Sie ein, die harmonische Mischung aus Tradition, Kultur und festlicher Stimmung zu erleben. Begleiten Sie uns, wenn wir die Ecken und Winkel dieses bayerischen Wandteppichs erkunden, wo jeder Moment ein Fest des zeitlosen Reizes Mnchens ist. Prost! \"}',1,'2023-11-26 12:48:16','2024-03-26 11:00:22','34d56ade-10ee-42b8-a58a-1c8708bb5443'),(2944,736,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Munich is synonymous with Oktoberfest, the world\'s largest Volksfest that attracts millions of visitors every year. The city transforms into a lively celebration of Bavarian culture, complete with traditional music, delicious cuisine, and of course, the finest beer. Beyond Oktoberfest, Munich\'s beer gardens like the famous Hofbruhaus offer an authentic taste of local brews and a convivial atmosphere that defines the Bavarian way of life.\\n\\nMunich\'s culinary landscape is a gastronomic adventure, with traditional Bavarian fare complemented by international influences. From the hearty sausages of Viktualienmarkt to the Michelin-starred restaurants, the city caters to diverse palates. Don\'t miss the chance to savor a pretzel or indulge in a delectable slice of Apfelstrudel while exploring the city.\\n\\nIn Munich, the past and present coalesce, creating an atmosphere that is both enchanting and dynamic. Whether you\'re strolling through historic squares, immersing yourself in cultural treasures, or raising a stein in a bustling beer garden, Munich invites you to experience the harmonious blend of tradition, culture, and festive cheer. Join us as we explore the nooks and crannies of this Bavarian tapestry, where each moment is a celebration of Munich\'s timeless allure. Prost! \"}',1,'2023-11-26 12:48:16','2024-03-26 11:00:22','640ab4be-9627-4b00-b6bd-ecfa53f4467f'),(3142,23,10,'Example 59',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-27 01:08:24','2023-11-27 01:08:24','ddad4344-eb08-418b-ac47-cd2737ac7485'),(3144,25,10,'Example 61',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-27 01:08:24','2023-11-27 01:08:24','cbedb116-1fe0-4ed4-9dc8-f9492c58b258'),(3146,31,10,'Example 10',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-27 01:08:24','2023-11-27 01:08:24','4380