.m. to 6:00 p.m.; Thursday until 8:00 p.m.\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Pinakothek der Moderne: contemporary art in all its glory\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Pinakothek der Moderne unites four different collections under one roof: art, graphic design, architecture and design. Here, visitors can experience contemporary art by internationally renowned artists. The diverse collection reflects the creative diversity of the modern art scene and encourages reflection on current social issues.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek-der-moderne.de/en/\"}',1,'2023-11-28 08:19:24','2024-03-26 11:00:23','dec9eee4-c53b-404b-a93e-4a9a24c31deb'),(4199,954,9,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Da marted a domenica, dalle 10:00 alle 18:00; gioved fino alle 20:00.\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Pinakothek der Moderne: l\'arte contemporanea in tutto il suo splendore\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"La Pinakothek der Moderne riunisce sotto lo stesso tetto quattro diverse collezioni: arte, grafica, architettura e design. Qui i visitatori possono ammirare l\'arte contemporanea di artisti di fama internazionale. La variegata collezione riflette la diversit creativa della scena artistica moderna e incoraggia la riflessione su temi sociali attuali.\"}',1,'2023-11-28 08:19:24','2024-03-26 11:00:23','d78482a1-33b0-4731-8039-acd6196aa86c'),(4200,954,10,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 10:00 Uhr bis 18:00 Uhr; Donnerstag bis 20:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Pinakothek der Moderne: Zeitgenssische Kunst in voller Pracht\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Die Pinakothek der Moderne vereint vier verschiedene Sammlungen unter einem Dach: Kunst, Grafikdesign, Architektur und Design. Hier knnen Besucher zeitgenssische Kunst von international renommierten Knstlern erleben. Die vielfltige Sammlung reflektiert die kreative Vielfalt der modernen Kunstszene und regt zum Nachdenken ber aktuelle gesellschaftliche Themen an.\"}',1,'2023-11-28 08:19:24','2024-03-26 11:00:23','dcd61b65-4f32-4602-94f4-8582f2fdc4c9'),(4201,955,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 10:00 Uhr bis 18:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"BMW Museum: Eine Reise durch die Geschichte der Mobilitt\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Fr Automobil-Enthusiasten ist das BMW Museum ein wahres Paradies. Die Ausstellung fhrt Besucher durch die faszinierende Geschichte der Marke BMW und die Entwicklung von Fahrzeugen, die nicht nur Fortbewegungsmittel, sondern auch Kunstwerke auf Rdern sind. Von historischen Modellen bis zu visionren Konzeptfahrzeugen bietet das Museum eine beeindruckende Perspektive auf die Welt der Mobilitt.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.bmw-welt.com/de/index.html\"}',1,'2023-11-28 08:19:24','2024-03-26 11:00:23','4609aaa9-197a-478e-894b-5398302da561'),(4202,955,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Tuesday to Sunday, 10:00 am to 6:00 pm\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"BMW Museum: A journey through the history of mobility\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The BMW Museum is a true paradise for automobile enthusiasts. The exhibition takes visitors through the fascinating history of the BMW brand and the development of vehicles that are not only means of transportation, but also works of art on wheels. From historic models to visionary concept cars, the museum offers an impressive perspective on the world of mobility.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.bmw-welt.com/en/index.html\"}',1,'2023-11-28 08:19:24','2024-03-26 11:00:23','8294a0e6-bd14-4e8d-863d-37f08fe27e4a'),(4203,955,9,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Museo BMW: un viaggio nella storia della mobilit\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Museo BMW  un vero paradiso per gli appassionati di automobili. L\'esposizione conduce i visitatori attraverso l\'affascinante storia del marchio BMW e lo sviluppo di veicoli che non sono solo mezzi di trasporto, ma anche opere d\'arte su ruote. Dai modelli storici alle visionarie concept car, il museo offre una prospettiva impressionante sul mondo della mobilit.\"}',1,'2023-11-28 08:19:24','2023-11-28 08:19:24','2f13d381-220f-4289-86a0-3a868a637ec7'),(4204,955,10,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"BMW Museum: Eine Reise durch die Geschichte der Mobilitt\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Fr Automobil-Enthusiasten ist das BMW Museum ein wahres Paradies. Die Ausstellung fhrt Besucher durch die faszinierende Geschichte der Marke BMW und die Entwicklung von Fahrzeugen, die nicht nur Fortbewegungsmittel, sondern auch Kunstwerke auf Rdern sind. Von historischen Modellen bis zu visionren Konzeptfahrzeugen bietet das Museum eine beeindruckende Perspektive auf die Welt der Mobilitt.\"}',1,'2023-11-28 08:19:24','2023-11-28 08:19:24','0a6d8ecf-f7df-4546-a55e-0717af300c15'),(4205,956,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Sonntag bis Donnerstag, 10:00 Uhr bis 18:00 Uhr; Freitag, 10:00 Uhr bis 14:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jdisches Museum Mnchen: Zeugnis jdischer Geschichte und Kultur\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Jdische Museum Mnchen erzhlt die Geschichte der jdischen Gemeinschaft in Mnchen und Bayern. Die Ausstellungen beleuchten die vielfltige Kultur, Traditionen und das wechselhafte Schicksal der jdischen Bevlkerung. Neben historischen Artefakten werden auch zeitgenssische knstlerische Arbeiten prsentiert, die die Bedeutung der jdischen Kultur im heutigen Mnchen verdeutlichen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.juedisches-museum-muenchen.de/\"}',1,'2023-11-28 08:19:24','2024-03-26 11:00:23','10ecd326-ed74-4b83-88a3-30f5d61379b3'),(4206,956,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Sunday to Thursday, 10:00 a.m. to 6:00 p.m.; Friday, 10:00 a.m. to 2:00 p.m.\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jewish Museum Munich: Testimony to Jewish history and culture\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Jewish Museum Munich tells the story of the Jewish community in Munich and Bavaria. The exhibitions shed light on the diverse culture, traditions and eventful fate of the Jewish population. In addition to historical artifacts, contemporary artistic works are also presented that illustrate the significance of Jewish culture in Munich todayn.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.juedisches-museum-muenchen.de/en/\"}',1,'2023-11-28 08:19:24','2024-03-26 11:00:23','c58a2a8e-1c75-45fd-8f3a-03022a9eda91'),(4207,956,9,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Museo ebraico di Monaco: Testimonianza della storia e della cultura ebraica\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Museo ebraico di Monaco racconta la storia della comunit ebraica di Monaco e della Baviera. Le mostre fanno luce sulla cultura, le tradizioni e il destino travagliato della popolazione ebraica. Oltre ai reperti storici, vengono presentate anche opere artistiche contemporanee che illustrano l\'importanza della cultura ebraica a Monaco oggi.\"}',1,'2023-11-28 08:19:24','2023-11-28 08:19:24','2df4155a-d160-4fef-a491-f6d006c33259'),(4208,956,10,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jdisches Museum Mnchen: Zeugnis jdischer Geschichte und Kultur\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Jdische Museum Mnchen erzhlt die Geschichte der jdischen Gemeinschaft in Mnchen und Bayern. Die Ausstellungen beleuchten die vielfltige Kultur, Traditionen und das wechselhafte Schicksal der jdischen Bevlkerung. Neben historischen Artefakten werden auch zeitgenssische knstlerische Arbeiten prsentiert, die die Bedeutung der jdischen Kultur im heutigen Mnchen verdeutlichen.\"}',1,'2023-11-28 08:19:24','2023-11-28 08:19:24','ab087648-1b8c-4d16-9e16-1d8952241017'),(4209,957,7,NULL,NULL,NULL,'{\"a5f31ac1-d94c-4311-82fa-1ef9ce42f581\": \"Fazit\", \"fa86aa14-6f7b-40cc-80f3-f615590ffac3\": \"h2\"}',1,'2023-11-28 08:19:24','2023-11-28 08:19:24','22544973-8ccd-4935-9e30-da40da905e1e'),(4210,957,8,NULL,NULL,NULL,'{\"a5f31ac1-d94c-4311-82fa-1ef9ce42f581\": \"Conclusion\", \"fa86aa14-6f7b-40cc-80f3-f615590ffac3\": \"h2\"}',1,'2023-11-28 08:19:24','2023-11-28 08:19:24','78de1aee-9831-4191-99f1-4fbaca95d27f'),(4211,957,9,NULL,NULL,NULL,'{\"a5f31ac1-d94c-4311-82fa-1ef9ce42f581\": \"Conclusione\", \"fa86aa14-6f7b-40cc-80f3-f615590ffac3\": \"h2\"}',1,'2023-11-28 08:19:24','2023-11-28 08:19:24','f4c30067-3e86-4391-b7af-0aab2a918106'),(4212,957,10,NULL,NULL,NULL,'{\"a5f31ac1-d94c-4311-82fa-1ef9ce42f581\": \"Fazit\", \"fa86aa14-6f7b-40cc-80f3-f615590ffac3\": \"h2\"}',1,'2023-11-28 08:19:24','2023-11-28 08:19:24','895664b1-af69-452b-83be-5973a7b6b875'),(4213,958,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Mnchens Museen bieten eine beeindruckende Bandbreite an kulturellen Schtzen und Erlebnissen. Von klassischer Kunst ber Technik und Design bis hin zur faszinierenden Welt der Mobilitt und der jdischen Geschichte  die bayerische Metropole prsentiert sich als wahres Eldorado fr kulturell interessierte Besucher. Ein Museumsbesuch in Mnchen ist nicht nur eine Reise in die Vergangenheit, sondern auch eine Entdeckungsreise durch die Vielfalt der menschlichen Kreativitt und Innovation.\"}',1,'2023-11-28 08:19:24','2023-11-28 08:19:24','544f6fee-6bf1-4ce8-b56a-f1e7d7a6727d'),(4214,958,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Munich\'s museums offer an impressive range of cultural treasures and experiences. From classical art, technology and design to the fascinating world of mobility and Jewish history - the Bavarian metropolis presents itself as a true Eldorado for culturally interested visitors. A visit to a museum in Munich is not only a journey into the past, but also a voyage of discovery through the diversity of human creativity and innovation.\"}',1,'2023-11-28 08:19:24','2023-11-28 08:19:24','857f5b76-2721-4056-8d6d-07d100d1e834'),(4215,958,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"I musei di Monaco offrono un\'impressionante gamma di tesori ed esperienze culturali. Dall\'arte classica, alla tecnologia e al design, fino all\'affascinante mondo della mobilit e della storia ebraica, la metropoli bavarese si presenta come un vero e proprio Eldorado per i visitatori culturalmente interessati. Una visita a un museo di Monaco non  solo un viaggio nel passato, ma anche un viaggio alla scoperta della diversit della creativit e dell\'innovazione umana.\"}',1,'2023-11-28 08:19:24','2023-11-28 08:19:24','78355c0d-d8d8-4232-82dd-2c5f25d08ef5'),(4216,958,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Mnchens Museen bieten eine beeindruckende Bandbreite an kulturellen Schtzen und Erlebnissen. Von klassischer Kunst ber Technik und Design bis hin zur faszinierenden Welt der Mobilitt und der jdischen Geschichte  die bayerische Metropole prsentiert sich als wahres Eldorado fr kulturell interessierte Besucher. Ein Museumsbesuch in Mnchen ist nicht nur eine Reise in die Vergangenheit, sondern auch eine Entdeckungsreise durch die Vielfalt der menschlichen Kreativitt und Innovation.\"}',1,'2023-11-28 08:19:24','2023-11-28 08:19:24','fef024a9-aa87-4563-a2d4-efd6fd463c10'),(4265,985,7,'Jdisches Museum','juedisches-museum','locations/juedisches-museum','{\"bdb6f666-a7d8-4206-ac3d-47159c88280f\": \"St.-Jakobs-Platz 16, 80331 Mnchen\"}',1,'2023-11-28 08:22:39','2023-11-28 09:53:01','7662dd33-3730-4f38-9ee5-697ec34c111d'),(4266,985,8,'Jdisches Museum','juedisches-museum','locations/juedisches-museum','{\"bdb6f666-a7d8-4206-ac3d-47159c88280f\": \"St.-Jakobs-Platz 16, 80331 Mnchen\"}',1,'2023-11-28 08:22:39','2023-1