chichte Mnchens. Benannt nach den berhmten Mnchner Kabarettisten Karl Valentin und Liesl Karlstadt, bietet das Museum einen faszinierenden Einblick in ihr Leben und Werk. Besucher knnen durch humorvolle Ausstellungen, Originalrequisiten und persnliche Gegenstnde der Knstler schlendern. Das Musum ist eine lebendige Erinnerung an die satirische Tradition Mnchens und zeigt, wie Karl Valentin und Liesl Karlstadt mit Witz und Ironie die Gesellschaft ihrer Zeit kritisierten. Ein Besuch verspricht nicht nur kulturelle Bereicherung, sondern auch jede Menge Lachen und Unterhaltung. Tauchen Sie ein in die Welt des bayerischen Kabaretts und erleben Sie die einzigartige Atmosphre des Valentin-Karlstadt-Musums!\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.valentin-karlstadt-musaeum.de/\"}',1,'2023-11-28 08:27:57','2024-03-26 11:00:23','9f50ff84-0b5f-4652-8b37-4986f9e723b8'),(4302,994,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Tuesday to Sunday, 11:00 am to 5:00 pm\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Valentin Karlstadt Museum: Insight into Munich\'s cabaret history\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"cThe Valentin-Karlstadt-Musum is a unique tribute to Munich\'s cabaret history. Named after the famous Munich cabaret artists Karl Valentin and Liesl Karlstadt, the museum offers a fascinating insight into their lives and work. Visitors can stroll through humorous exhibitions, original props and personal items belonging to the artists. The Musum is a living reminder of Munich\'s satirical tradition and shows how Karl Valentin and Liesl Karlstadt criticized the society of their time with wit and irony. A visit promises not only cultural enrichment, but also plenty of laughter and entertainment. Immerse yourself in the world of Bavarian cabaret and experience the unique atmosphere of the Valentin-Karlstadt-Muse!\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.valentin-karlstadt-musaeum.de/\"}',1,'2023-11-28 08:27:57','2