erta-della-lunga-notte-dei-musei','articoli/una-notte-di-cultura-a-monaco-alla-scoperta-della-lunga-notte-dei-musei','{\"af872e03-1253-4002-8d19-6dae768135a3\": false}',1,'2023-11-28 09:40:41','2023-11-28 10:26:34','35609f04-58ad-4530-a9e3-922d970da75b'),(4530,1049,10,'Eine Kultur-Nacht in Mnchen: Auf Entdeckungstour bei der langen Nacht der Museen','eine-kultur-nacht-in-muenchen-auf-entdeckungstour-bei-der-langen-nacht-der-museen','articles/eine-kultur-nacht-in-muenchen-auf-entdeckungstour-bei-der-langen-nacht-der-museen','{\"af872e03-1253-4002-8d19-6dae768135a3\": false}',0,'2023-11-28 09:40:41','2023-11-28 09:50:59','df6870d4-d92a-4515-bc8c-def081361649'),(4643,1078,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Mnchen, eine Stadt reich an Geschichte und Kultur, ffnet ihre Tren fr eine faszinierende \\\"Lange Nacht der Museen\\\". Unter den vielen herausragenden Institutionen, die an diesem besonderen Abend ihre Pforten ffnen, nehmen das Deutsche Museum und das Jdische Museum eine herausragende Rolle ein. Tauchen wir ein in die kulturelle Vielfalt und die fesselnden Erlebnisse, die diese beiden Museen bieten.\"}',1,'2023-11-28 09:46:01','2023-11-28 09:46:01','b88df937-d3e4-4643-8751-36fb468145e8'),(4644,1078,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Munich, a city rich in history and culture, opens its doors for a fascinating \\\"Long Night of Museums\\\". Among the many outstanding institutions opening their doors on this special evening, the Deutsches Museum and the Jewish Museum play a prominent role. Let\'s immerse ourselves in the cultural diversity and captivating experiences offered by these two museums.\"}',1,'2023-11-28 09:46:01','2023-11-28 09:46:01','d60dec7d-456b-47ff-a488-c23a88bb7f4d'),(4645,1078,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Monaco di Baviera, citt ricca di storia e cultura, apre le sue porte per un\'affascinante \\\"Lunga Notte dei Musei\\\". Tra le molte istituzioni di spicco che aprono le loro porte in questa serata speciale, il Deutsches Museum e il Museo Ebraico giocano un ruolo di primo piano. Immergiamoci nella diversit culturale e nelle esperienze accattivanti offerte da questi due musei.\"}',1,'2023-11-28 09:46:01','2023-11-28 09:46:01','db2dce77-a7e7-4f4e-8ce3-83a3094980be'),(4646,1078,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Mnchen, eine Stadt reich an Geschichte und Kultur, ffnet ihre Tren fr eine faszinierende \\\"Lange Nacht der Museen\\\". Unter den vielen herausragenden Institutionen, die an diesem besonderen Abend ihre Pforten ffnen, nehmen das Deutsche Museum und das Jdische Museum eine herausragende Rolle ein. Tauchen wir ein in die kulturelle Vielfalt und die fesselnden Erlebnisse, die diese beiden Museen bieten.\"}',1,'2023-11-28 09:46:01','2023-11-28 09:46:01','3841385e-6297-432e-9588-923aaaaa072e'),(4647,1079,7,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: Eine Reise durch die Technikgeschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Deutsche Museum, das weltweit grte Museum fr Wissenschaft und Technologie, bietet den Besuchern eine faszinierende Reise durch die Geschichte der Technik. Von Dampfmaschinen bis zu modernen Raumfahrttechnologien erstreckt sich die Ausstellung ber mehrere Bereiche. Die Lange Nacht der Museen ermglicht es den Besuchern, in die faszinierende Welt der Innovationen einzutauchen.\\n\\nIm Herzen des Deutschen Museums befindet sich ein beeindruckendes Planetarium, das die Besucher zu einer Reise durch die Sterne einldt. Whrend der Langen Nacht werden spezielle Shows prsentiert, die den Nachthimmel ber Mnchen und darber hinaus erkunden.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://example.com\"}',1,'2023-11-28 09:46:01','2023-11-28 09:46:01','a7411f04-1cef-4381-94a8-bf63ebdf6828'),(4648,1079,8,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: A journey through the history of technology\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Deutsches Museum, the world\'s largest museum of science and technology, offers visitors a fascinating journey through the history of technology. From steam engines to modern space technologies, the exhibition spans several areas. The Long Night of Museums allows visitors to immerse themselves in the fascinating world of innovation.\\n\\nAt the heart of the Deutsches Museum is an impressive planetarium that invites visitors on a journey through the stars. During the Long Night, special shows are presented that explore the night sky over Munich and beyond.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://example.com\"}',1,'2023-11-28 09:46:01','2023-11-28 09:46:01','7450fbf3-1d5b-47bc-909c-8329af211fc0'),(4649,1079,9,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: un viaggio nella storia della tecnologia\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Deutsches Museum, il pi grande museo di scienza e tecnologia del mondo, offre ai visitatori un affascinante viaggio nella storia della tecnologia. Dalle macchine a vapore alle moderne tecnologie spaziali, l\'esposizione si estende su diverse aree. La Lunga Notte dei Musei permette ai visitatori di immergersi nell\'affascinante mondo dell\'innovazione.\\n\\nNel cuore del Deutsches Museum si trova un imponente planetario che invita i visitatori a fare un viaggio tra le stelle. Durante la Lunga Notte vengono presentati spettacoli speciali che esplorano il cielo notturno di Monaco e oltre.\"}',1,'2023-11-28 09:46:01','2023-11-28 09:46:01','1b0343e7-4870-4231-936e-c30613778e8a'),(4650,1079,10,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: Eine Reise durch die Technikgeschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Deutsche Museum, das weltweit grte Museum fr Wissenschaft und Technologie, bietet den Besuchern eine faszinierende Reise durch die Geschichte der Technik. Von Dampfmaschinen bis zu modernen Raumfahrttechnologien erstreckt sich die Ausstellung ber mehrere Bereiche. Die Lange Nacht der Museen ermglicht es den Besuchern, in die faszinierende Welt der Innovationen einzutauchen.\\n\\nIm Herzen des Deutschen Museums befindet sich ein beeindruckendes Planetarium, das die Besucher zu einer Reise durch die Sterne einldt. Whrend der Langen Nacht werden spezielle Shows prsentiert, die den Nachthimmel ber Mnchen und darber hinaus erkunden.\"}',1,'2023-11-28 09:46:01','2023-11-28 09:46:01','1a073739-05cc-4107-ad2d-c6076347182b'),(4651,1080,7,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jdisches Museum Mnchen: Eine Reise durch die Kultur und Geschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Jdische Museum Mnchen widmet sich der Aufarbeitung der Geschichte und Kultur der jdischen Gemeinschaft in Mnchen. Whrend der Langen Nacht der Museen wird das Museum zu einem Ort der Begegnung und des interkulturellen Austauschs.\\n\\nWhrend der Langen Nacht werden oft auch temporre Ausstellungen prsentiert, die verschiedene Aspekte der jdischen Kunst, Geschichte und Traditionen beleuchten.\\n\\nDas Jdische Museum fungiert nicht nur als Ort der Ausstellung, sondern auch als lebendiges Zentrum fr kulturelle Veranstaltungen. Whrend der Nacht knnen die Besucher an Vortrgen, Konzerten und Workshops teilnehmen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://example.com\"}',1,'2023-11-28 09:46:01','2023-11-28 09:46:01','1c7124f6-787b-4162-9316-f0422aacd645'),(4652,1080,8,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jewish Museum Munich: A journey through culture and history\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Jewish Museum Munich is dedicated to exploring the history and culture of the Jewish community in Munich. During the Long Night of Museums, the museum becomes a place for encounters and intercultural exchange.\\n\\nDuring the Long Night, temporary exhibitions are often presented that highlight various aspects of Jewish art, history and traditions.\\n\\nThe Jewish Museum functions not only as an exhibition venue, but also as a lively center for cultural events. During the night, visitors can take part in lectures, concerts and workshops.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://example.com\"}',1,'2023-11-28 09:46:01','2023-11-28 09:46:01','46c6229d-f0fc-40fe-bb68-aa523c1faab6'),(4653,1080,9,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Museo ebraico di Monaco: Un viaggio attraverso la cultura e la storia\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Museo Ebraico di Monaco  dedicato all\'analisi della storia e della cultura della comunit ebraica di Monaco. Durante la Lunga Notte dei Musei, il museo diventa un luogo di incontro e di scambio interculturale.\\n\\nDurante la Lunga Notte vengono spesso presentate anche mostre temporanee che mettono in luce vari aspetti dell\'arte, della storia e delle tradizioni ebraiche.\\n\\nIl Museo ebraico non funziona solo come sede espositiva, ma anche come vivace centro di eventi culturali. Durante la notte, i visitatori possono partecipare a conferenze, concerti e laboratori.\"}',1,'2023-11-28 09:46:01','2023-11-28 09:46:01','ab8ec3b1-c619-45ca-8631-ed0eae77ef78'),(4654,1080,10,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jdisches Museum Mnchen: Eine Reise durch die Kultur und Geschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Jdische Museum Mnchen widmet sich der Aufarbeitung der Geschichte und Kultur der jdischen Gemeinschaft in Mnchen. Whrend der Langen Nacht der Museen wird das Museum zu einem Ort der Begegnung und des interkulturellen Austauschs.\\n\\nWhrend der Langen Nacht werden oft auch temporre Ausstellungen prsentiert, die verschiedene Aspekte der jdischen Kunst, Geschichte und Traditionen beleuchten.\\n\\nDas Jdische Museum fungiert nicht nur als Ort der Ausstellung, sondern auch als lebendiges Zentrum fr kulturelle Veranstaltungen. Whrend der Nacht knnen die Besucher an Vortrgen, Konzerten und Workshops teilnehme\"}',1,'2023-11-28 09:46:01','2023-11-28 09:46:01','cee56a41-5dd1-4c27-b077-bf3409347c3b'),(4655,1081,6,'German museum 508486 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-28 09:47:40','2023-11-28 09:47:40','fd94ea00-2016-4af1-b7db-a5447b07688d'),(4656,1081,1,'German museum 508486 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-28 09:47:40','2023-11-28 09:47:40','90f6468f-371d-43e1-9b32-71ebd81ee9a6'),(4657,1081,2,'German museum 508486 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-28 09:47:40','2023-11-28 09:47:40','ace41358-a19d-4566-a892-72770b324489'),(4658,1081,4,'German museum 508486 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-28 09:47:40','2023-11-28 09:47:40','62ddc8d0-40bc-49e0-a53f-8d0547c915ca'),(4659,1081,3,'German museum 508486 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-28 09:47:40','2023-11-28 09:47:40','1a264885-e785-4a89-b273-dd1b21375232'),(4660,1081,7,'German museum 508486 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-28 09:47:40','2023-11-28 09:47:40','cb3f0624-c6ee-4960-ab51-692be2c3327e'),(4661,1081,8,'German museum 508486 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-28 09:47:40','2023-11-28 09:47:40','a27019c0-20fb-4c7d-bb86-b6c07aae881a'),(4662,1081,9,'German museum 508486 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"