tropole-entdecke-die-kulturperlen-munchens','{\"af872e03-1253-4002-8d19-6dae768135a3\": false}',0,'2023-11-28 10:24:47','2023-11-28 10:24:47','26507d52-a55a-4f87-8c4a-a23d05f2552a'),(4729,1098,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Monaco di Baviera, la vivace capitale bavarese, non  solo nota per la sua vivace cultura della birra e per i suoi magnifici edifici, ma ospita anche un\'impressionante variet di musei che presentano arte, storia e scienza in modo affascinante. Immergiamoci nel ricco panorama culturale di Monaco e scopriamo i migliori musei che meritano sicuramente una visita.\"}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','5e2182fd-2459-4d01-a941-67638a79632d'),(4730,1098,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Mnchen, die pulsierende bayerische Hauptstadt, ist nicht nur fr ihre lebendige Bierkultur und prchtigen Bauten bekannt, sondern beherbergt auch eine beeindruckende Vielfalt an Museen, die Kunst, Geschichte und Wissenschaft auf faszinierende Weise prsentieren. Tauchen wir ein in die reiche Kulturlandschaft Mnchens und entdecken die besten Museen, die einen Besuch definitiv lohnen.\"}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','0b36428a-fdcc-40e4-876d-bd212ef0c98f'),(4731,1098,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Munich, the vibrant Bavarian capital, is not only known for its lively beer culture and magnificent buildings, but is also home to an impressive variety of museums that present art, history and science in a fascinating way. Let\'s immerse ourselves in Munich\'s rich cultural landscape and discover the best museums that are definitely worth a visit.\"}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','9b591709-73dd-4704-b7c1-44b4ec6d31fa'),(4732,1098,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Mnchen, die pulsierende bayerische Hauptstadt, ist nicht nur fr ihre lebendige Bierkultur und prchtigen Bauten bekannt, sondern beherbergt auch eine beeindruckende Vielfalt an Museen, die Kunst, Geschichte und Wissenschaft auf faszinierende Weise prsentieren. Tauchen wir ein in die reiche Kulturlandschaft Mnchens und entdecken die besten Museen, die einen Besuch definitiv lohnen.\"}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','3d623727-7aa8-4e56-bcd9-f34d502503c0'),(4733,1099,9,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Da marted a domenica, dalle 10:00 alle 18:00\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Alte Pinakothek: capolavori della pittura europea\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"L\'Alte Pinakothek  una delle pi antiche e importanti collezioni d\'arte del mondo. Qui i visitatori possono ammirare i capolavori della pittura europea, da artisti come Albrecht Drer a Rembrandt e Rubens. I magnifici dipinti offrono un\'affascinante visione dello sviluppo della storia dell\'arte e fanno battere forte il cuore degli amanti dell\'arte.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek.de/de/besuch/alte-pinakothek\"}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','6534a1d9-73bd-4c38-9a34-efb6d500801a'),(4734,1099,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 10:00 Uhr bis 18:00 Uh\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Alte Pinakothek: Meisterwerke der europischen Malerei\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Die Alte Pinakothek zhlt zu den ltesten und bedeutendsten Kunstsammlungen der Welt. Hier knnen Besucher Meisterwerke europischer Malerei bewundern, von Knstlern wie Albrecht Drer ber Rembrandt bis hin zu Rubens. Die prachtvollen Gemlde bieten einen faszinierenden Einblick in die Entwicklung der Kunstgeschichte und lassen die Herzen von Kunstliebhabern hherschlagen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek.de/de/besuch/alte-pinakothek\"}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','b20965a6-3a2d-4293-b2f7-8793fb4575a3'),(4735,1099,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Tuesday to Sunday, 10:00 am to 6:00 pm\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Alte Pinakothek: Masterpieces of European painting\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Alte Pinakothek is one of the oldest and most important art collections in the world. Here, visitors can admire masterpieces of European painting, from artists such as Albrecht Drer to Rembrandt and Rubens. The magnificent paintings offer a fascinating insight into the development of art history and make the hearts of art lovers beat faster.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek.de/en/visit/alte-pinakothek\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','893ff754-8d59-4cc8-abb8-07c9b6b82682'),(4736,1099,10,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 10:00 Uhr bis 18:00 Uh\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Alte Pinakothek: Meisterwerke der europischen Malerei\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Die Alte Pinakothek zhlt zu den ltesten und bedeutendsten Kunstsammlungen der Welt. Hier knnen Besucher Meisterwerke europischer Malerei bewundern, von Knstlern wie Albrecht Drer ber Rembrandt bis hin zu Rubens. Die prachtvollen Gemlde bieten einen faszinierenden Einblick in die Entwicklung der Kunstgeschichte und lassen die Herzen von Kunstliebhabern hherschlagen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek.de/de/besuch/alte-pinakothek\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','0afce4a2-53b8-4c25-ba32-fa0beaf950fc'),(4737,1100,9,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Da luned a domenica, dalle 9:00 alle 17:00\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: tecnologia e scienza da toccare con mano\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Deutsches Museum  una tappa obbligata per gli appassionati di tecnologia e scienza.  uno dei pi grandi musei scientifici e tecnologici del mondo e presenta mostre interattive su temi quali la fisica, l\'astronomia e i progressi della tecnologia. Con numerose stazioni sperimentali e mostre impressionanti, il museo offre un\'esperienza divertente ed educativa per i visitatori di tutte le et.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','a3c1fecd-4938-446c-b144-6e0334fbdf5f'),(4738,1100,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Montag bis Sonntag, 9:00 Uhr bis 17:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: Technik und Wissenschaft zum Anfassen\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Fr Technik- und Wissenschaftsbegeisterte ist das Deutsche Museum ein absolutes Muss. Als eines der grten naturwissenschaftlich-technischen Museen der Welt prsentiert es interaktive Ausstellungen zu Themen wie Physik, Astronomie und Fortschritt der Technologie. Mit zahlreichen Experimentierstationen und beeindruckenden Exponaten bietet das Museum eine unterhaltsame und lehrreiche Erfahrung fr Besucher aller Altersgruppen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.deutsches-museum.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','110f8ce9-b107-4686-a8dd-6a24b9e1ec3d'),(4739,1100,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Monday to Sunday, 9:00 am to 5:00 pm\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: hands-on technology and science\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Deutsches Museum is an absolute must for technology and science enthusiasts. As one of the largest science and technology museums in the world, it presents interactive exhibitions on topics such as physics, astronomy and advances in technology. With numerous experimental stations and impressive exhibits, the museum offers an entertaining and educational experience for visitors of all ages.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.deutsches-museum.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','1e58a235-2833-4d4b-be46-fb2164b6