sche Kunst von international renommierten Knstlern erleben. Die vielfltige Sammlung reflektiert die kreative Vielfalt der modernen Kunstszene und regt zum Nachdenken ber aktuelle gesellschaftliche Themen an.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek-der-moderne.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','70a5a6d3-6b9b-48e8-9b6b-6eebed7d9623'),(4743,1101,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Tuesday to Sunday, 10:00 a.m. to 6:00 p.m.; Thursday until 8:00 p.m.\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Pinakothek der Moderne: contemporary art in all its glory\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Pinakothek der Moderne unites four different collections under one roof: art, graphic design, architecture and design. Here, visitors can experience contemporary art by internationally renowned artists. The diverse collection reflects the creative diversity of the modern art scene and encourages reflection on current social issues.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek-der-moderne.de/en/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','b201cf11-22ce-4bff-8552-970fb65e5b9a'),(4744,1101,10,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 10:00 Uhr bis 18:00 Uhr; Donnerstag bis 20:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Pinakothek der Moderne: Zeitgenssische Kunst in voller Pracht\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Die Pinakothek der Moderne vereint vier verschiedene Sammlungen unter einem Dach: Kunst, Grafikdesign, Architektur und Design. Hier knnen Besucher zeitgenssische Kunst von international renommierten Knstlern erleben. Die vielfltige Sammlung reflektiert die kreative Vielfalt der modernen Kunstszene und regt zum Nachdenken ber aktuelle gesellschaftliche Themen an.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','e029e859-4ac5-4b42-8ea0-9d606f0dbd80'),(4745,1102,9,NULL,NULL,NULL,'{\"5605656f-e22e-