an impressive perspective on the world of mobility.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.bmw-welt.com/en/index.html\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','b7d121fb-891f-48a8-b4d9-ce96ff05053f'),(4748,1102,10,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"BMW Museum: Eine Reise durch die Geschichte der Mobilitt\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Fr Automobil-Enthusiasten ist das BMW Museum ein wahres Paradies. Die Ausstellung fhrt Besucher durch die faszinierende Geschichte der Marke BMW und die Entwicklung von Fahrzeugen, die nicht nur Fortbewegungsmittel, sondern auch Kunstwerke auf Rdern sind. Von historischen Modellen bis zu visionren Konzeptfahrzeugen bietet das Museum eine beeindruckende Perspektive auf die Welt der Mobilitt.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','c0f4064f-baf4-47e1-94e3-1573a519cf98'),(4749,1103,9,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Museo ebraico di Monaco: Testimonianza della storia e della cultura ebraica\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Museo ebraico di Monaco racconta la storia della comunit ebraica di Monaco e della Baviera. Le mostre fanno luce sulla cultura, le tradizioni e il destino travagliato della popolazione ebraica. Oltre ai reperti storici, vengono presentate anche opere artistiche contemporanee che illustrano l\'importanza della cultura ebraica a Monaco oggi.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','f2bdb7f9-c0f7-4bb3-8784-e1b73cb068b7'),(4750,1103,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Sonntag bis Donnerstag, 10:00 Uhr bis 18:00 Uhr; Freitag, 10:00 Uhr bis 14:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jdisches Museum Mnchen: Zeugnis jdischer Geschichte und Kultur\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Jdische Museum Mnchen erzhlt die Geschichte der jdischen Gemeinschaft in Mnchen und Bayern. Die Ausstellungen beleuchten die vielfltige Kultur, Traditionen und das wechselhafte Schicksal der jdischen Bevlkerung. Neben historischen Artefakten werden auch zeitgenssische knstlerische Arbeiten prsentiert, die die Bedeutung der jdischen Kultur im heutigen Mnchen verdeutlichen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.juedisches-museum-muenchen.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','b93bf3eb-2e05-4310-b2c2-59b91f485212'),(4751,1103,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Sunday to Thursday, 10:00 a.m. to 6:00 p.m.; Friday, 10:00 a.m. to 2:00 p.m.\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jewish Museum Munich: Testimony to Jewish history and culture\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Jewish Museum Munich tells the story of the Jewish community in Munich and Bavaria. The exhibitions shed light on the diverse culture, traditions and eventful fate of the Jewish population. In addition to historical artifacts, contemporary artistic works are also presented that illustrate the significance of Jewish culture in Munich todayn.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.juedisches-museum-muenchen.de/en/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','f7c17786-dcec-422c-81d3-353135a1cfbf'),(4752,1103,10,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jdisches Museum Mnchen: Zeugnis jdischer Geschichte und Kultur\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Jdische Museum Mnchen erzhlt die Geschichte der jdischen Gemeinschaft in Mnchen und Bayern. Die Ausstellungen beleuchten die vielfltige Kultur, Traditionen und das wechselhafte Schicksal der jdischen Bevlkerung. Neben historischen Artefakten werden auch zeitgenssische knstlerische Arbeiten prsentiert, die die Bedeutung der jdischen Kultur im heutigen Mnchen verdeutlichen.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','c3eb857d-86b0-42aa-a7a6-89b92bd2f2d8'),(4753,1104,9,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 11:00 Uhr bis 17:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Valentin-Karlstadt-Musum: Einblick in Mnchens Kabarettgeschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Valentin-Karlstadt-Muse  un tributo unico alla storia del cabaret di Monaco. Il museo, che prende il nome dai famosi cabarettisti Karl Valentin e Liesl Karlstadt, offre un\'affascinante visione della loro vita e del loro lavoro. I visitatori possono passeggiare tra mostre umoristiche, oggetti di scena originali e oggetti personali degli artisti. Il Musum  un ricordo vivo della tradizione satirica di Monaco e mostra come Karl Valentin e Liesl Karlstadt criticassero la societ del loro tempo con arguzia e ironia. Una visita promette non solo un arricchimento culturale, ma anche tante risate e divertimento. Immergetevi nel mondo del cabaret bavarese e vivete l\'atmosfera unica del Valentin-Karlstadt-Museum!\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.valentin-karlstadt-musaeum.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','f575fe1c-5566-4cb2-a998-9adcaffb7ea2'),(4754,1104,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 11:00 Uhr bis 17:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Valentin-Karlstadt-Musum: Einblick in Mnchens Kabarettgeschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Valentin-Karlstadt-Musum ist eine einzigartige Hommage an die Kabarettgeschichte Mnchens. Benannt nach den berhmten Mnchner Kabarettisten Karl Valentin und Liesl Karlstadt, bietet das Museum einen faszinierenden Einblick in ihr Leben und Werk. Besucher knnen durch humorvolle Ausstellungen, Originalrequisiten und persnliche Gegenstnde der Knstler schlendern. Das Musum ist eine lebendige Erinnerung an die satirische Tradition Mnchens und zeigt, wie Karl Valentin und Liesl Karlstadt mit Witz und Ironie die Gesellschaft ihrer Zeit kritisierten. Ein Besuch verspricht nicht nur kulturelle Bereicherung, sondern auch jede Menge Lachen und Unterhaltung. Tauchen Sie ein in die Welt des bayerischen Kabaretts und erleben Sie die einzigartige Atmosphre des Valentin-Karlstadt-Musums!\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.valentin-karlstadt-musaeum.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','c856adc8-c2c3-4474-9a4d-9f3045870fe2'),(4755,1104,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Tuesday to Sunday, 11:00 am to 5:00 pm\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Valentin Karlstadt Museum: Insight into Munich\'s cabaret history\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"cThe Valentin-Karlstadt-Musum is a unique tribute to Munich\'s cabaret history. Named after the famous Munich cabaret artists Karl Valentin and Liesl Karlstadt, the museum offers a fascinating insight into their lives and work. Visitors can stroll through humorous exhibitions, original props and personal items belonging to the artists. The Musum is a living reminder of Munich\'s satirical tradition and shows how Karl Valentin and Liesl Karlstadt criticized the society of their time with wit and irony. A visit promises not only cultural enrichment, but also plenty of laughter and entertainment. Immerse yourself in the world of Bavarian cabaret and experience the unique atmosphere of the Valentin-Karlstadt-Muse!\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.valentin-karlstadt-musaeum.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','8166d33c-a7dc-44b3-9caa-b8f3bf4b40df'),(4756,1104,10,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 11:00 Uhr bis 17:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Valentin-Karlstadt-Musum: Einblick in Mnchens Kabarettgeschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Valentin-Karlstadt-Musum ist eine einzigartige Hommage an die Kabarettgeschichte Mnchens. Benannt nach den berhmten Mnchner Kabarettisten Karl Valentin und Liesl Karlstadt, bietet das Museum einen faszinierenden Einblick in ihr Leben und 