\". Among the many outstanding institutions opening their doors on this special evening, the Deutsches Museum and the Jewish Museum play a prominent role. Let\'s immerse ourselves in the cultural diversity and captivating experiences offered by these two museums.\"}',1,'2023-12-02 19:33:11','2023-12-02 19:33:11','330d90e8-3b08-41de-9fbc-998e189f79a5'),(5153,1180,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Monaco di Baviera, citt ricca di storia e cultura, apre le sue porte per un\'affascinante \\\"Lunga Notte dei Musei\\\". Tra le molte istituzioni di spicco che aprono le loro porte in questa serata speciale, il Deutsches Museum e il Museo Ebraico giocano un ruolo di primo piano. Immergiamoci nella diversit culturale e nelle esperienze accattivanti offerte da questi due musei.\"}',1,'2023-12-02 19:33:11','2023-12-02 19:33:11','9a53b65e-a630-412a-98d1-069f0dbb2fda'),(5154,1180,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Mnchen, eine Stadt reich an Geschichte und Kultur, ffnet ihre Tren fr eine faszinierende \\\"Lange Nacht der Museen\\\". Unter den vielen herausragenden Institutionen, die an diesem besonderen Abend ihre Pforten ffnen, nehmen das Deutsche Museum und das Jdische Museum eine herausragende Rolle ein. Tauchen wir ein in die kulturelle Vielfalt und die fesselnden Erlebnisse, die diese beiden Museen bieten.\"}',1,'2023-12-02 19:33:11','2023-12-02 19:33:11','83ef5d34-1611-4f88-9478-5857ee040ed7'),(5155,1181,7,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: Eine Reise durch die Technikgeschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Deutsche Museum, das weltweit grte Museum fr Wissenschaft und Technologie, bietet den Besuchern eine faszinierende Reise durch die Geschichte der Technik. Von Dampfmaschinen bis zu modernen Raumfahrttechnologien erstreckt sich die Ausstellung ber mehrere Bereiche. Die Lange Nacht der Museen ermglicht es den Besuchern, in die faszinierende Welt der Innovationen einzutauchen.\\n\\nIm Herzen des Deutschen Museums befindet sich ein beeindruckendes Planetarium, das die Besucher zu einer Reise durch die Sterne einldt. Whrend der Langen Nacht werden spezielle Shows prsentiert, die den Nachthimmel ber Mnchen und darber hinaus erkunden.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://example.com\"}',1,'2023-12-02 19:33:11','2023-12-02 19:33:11','ec0b4761-1ea8-46f8-8a41-ad5b90bed5e9'),(5156,1181,8,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: A journey through the history of technology\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Deutsches Museum, the world\'s largest museum of science and technology, offers visitors a fascinating journey through the history of technology. From steam engines to modern space technologies, the exhibition spans several areas. The Long Night of Museums allows visitors to immerse themselves in the fascinating world of innovation.\\n\\nAt the heart of the Deutsches Museum is an impressive planetarium that invites visitors on a journey through the stars. During the Long Night, special shows are presented that explore the night sky over Munich and beyond.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://example.com\"}',1,'2023-12-02 19:33:11','2023-12-02 19:33:11','693a71be-5e05-4616-b09d-d56225bf4cb8'),(5157,1181,9,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: un viaggio nella storia della tecnologia\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Deutsches Museum, il pi grande museo di scienza e tecnologia del mondo, offre ai visitatori un affascinante viaggio nella storia della tecnologia. Dalle macchine a vapore alle moderne tecnologie spaziali, l\'esposizione si estende su diverse aree. La Lunga Notte dei Musei permette ai visitatori di immergersi nell\'affascinante mondo dell\'innovazione.\\n\\nNel cuore del Deutsches Museum si trova un imponente planetario che invita i visitatori a fare un viaggio tra le stelle. Durante la Lunga Notte vengono presentati spettacoli speciali che esplorano il cielo notturno di Monaco e oltre.\"}',1,'2023-12-02 19:33:11','2023-12-02 19:33:11','1ff7cc53-3d8e-4b36-a4dc-617a7abb2bfc'),(5158,1181,10,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: Eine Reise durch die Technikgeschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Deutsche Museum, das weltweit grte Museum fr Wissenschaft und Technologie, bietet den Besuchern eine faszinierende Reise durch die Geschichte der Technik. Von Dampfmaschinen bis zu modernen Raumfahrttechnologien erstreckt sich die Ausstellung ber mehrere Bereiche. Die Lange Nacht der Museen ermglicht es den Besuchern, in die faszinierende Welt der Innovationen einzutauchen.\\n\\nIm Herzen des Deutschen Museums befindet sich ein beeindruckendes Planetarium, das die Besucher zu einer Reise durch die Sterne einldt. Whrend der Langen Nacht werden spezielle Shows prsentiert, die den Nachthimmel ber Mnchen und darber hinaus erkunden.\"}',1,'2023-12-02 19:33:11','2023-12-02 19:33:11','48aaada8-86b1-44cc-b48e-8e1add978a7e'),(5159,1182,7,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jdisches Museum Mnchen: Eine Reise durch die Kultur und Geschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Jdische Museum Mnchen widmet sich der Aufarbeitung der Geschichte und Kultur der jdischen Gemeinschaft in Mnchen. Whrend der Langen Nacht der Museen wird das Museum zu einem Ort der Begegnung und des interkulturellen Austauschs.\\n\\nWhrend der Langen Nacht werden oft auch temporre Ausstellungen prsentiert, die verschiedene Aspekte der jdischen Kunst, Geschichte und Traditionen beleuchten.\\n\\nDas Jdische Museum fungiert nicht nur als Ort der Ausstellung, sondern auch als lebendiges Zentrum fr kulturelle Veranstaltungen. Whrend der Nacht knnen die Besucher an Vortrgen, Konzerten und Workshops teilnehmen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://example.com\"}',1,'2023-12-02 19:33:11','2023-12-02 19:33:11','062c0292-d155-4f49-8de1-280474a1cf6d'),(5160,1182,8,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jewish Museum Munich: A journey through culture and history\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Jewish Museum Munich is dedicated to exploring the history and culture of the Jewish community in Munich. During the Long Night of Museums, the museum becomes a place for encounters and intercultural exchange.\\n\\nDuring the Long Night, temporary exhibitions are often presented that highlight various aspects of Jewish art, history and traditions.\\n\\nThe Jewish Museum functions not only as an exhibition venue, but also as a lively center for cultural events. During the night, visitors can take part in lectures, concerts and workshops.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://example.com\"}',1,'2023-12-02 19:33:11','2023-12-02 19:33:11','a801d2d5-10c7-4447-8c50-1690d6adc161'),(5161,1182,9,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Museo ebraico di Monaco: Un viaggio attraverso la cultura e la storia\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Museo Ebraico di Monaco  dedicato all\'analisi della storia e della cultura della comunit ebraica di Monaco. Durante la Lunga Notte dei Musei, il museo diventa un luogo di incontro e di scambio interculturale.\\n\\nDurante la Lunga Notte vengono spesso presentate anche mostre temporanee che mettono in luce vari aspetti dell\'arte, della storia e delle tradizioni ebraiche.\\n\\nIl Museo ebraico non funziona solo come sede espositiva, ma anche come vivace centro di eventi culturali. Durante la notte, i visitatori possono partecipare a conferenze, concerti e laboratori.\"}',1,'2023-12-02 19:33:11','2023-12-02 19:33:11','7f80c4d6-68d7-4e87-aa73-8cf14dd610fe'),(5162,1182,10,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jdisches Museum Mnchen: Eine Reise durch die Kultur und Geschichte\", \"bb94c828-0ca3-4926-a7ce-c