023-12-03 14:40:35','2023-12-03 14:40:35','a31c2d5a-bf1c-42e7-93e3-75966ecd78cb'),(6102,1305,8,'Munich Mosaic: Tradition, Culture, and the Heartwarming Spirit of Celebration','munich-mosaic-tradition-culture-and-the-heartwarming-spirit-of-celebration','articles/munich-mosaic-tradition-culture-and-the-heartwarming-spirit-of-celebration','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','89daf307-4665-43c9-b001-bf49c658cb62'),(6103,1305,9,'Mosaico di Monaco di Baviera: tradizione, cultura e lo spirito di festa che scalda il cuore','mosaico-di-monaco-di-baviera-tradizione-cultura-e-lo-spirito-di-festa-che-scalda-il-cuore','articoli/mosaico-di-monaco-di-baviera-tradizione-cultura-e-lo-spirito-di-festa-che-scalda-il-cuore','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','8c8f103a-5b09-428c-92d9-3a2cc3ef6b95'),(6104,1306,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \" : ,        ,    ,              .       ,      ,   .\\n\\n            .   ,      ,       .       ,    .     ,         .\\n\\n      .       -Alte Pinakothek,          . -Pinacotek der Moderne,  ,      .     ,     ,         .\"}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','4a9e2ac1-e8e5-4025-87a2-40d0e24cc037'),(6105,1306,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Im Herzen Bayerns gelegen, ist Mnchen ein kulturelles Juwel, das jahrhundertealte Traditionen nahtlos mit einer modernen Lebendigkeit verbindet, die Einheimische und Besucher gleichermaen in ihren Bann zieht. Von der ikonischen Architektur bis hin zu den lebhaften Biergrten bietet Mnchen eine einzigartige Mischung aus Geschichte, Kultur und festlicher Ausgelassenheit.\\n\\nMnchens Skyline ist ein Zeugnis seiner reichen Geschichte und seines Engagements fr die Bewahrung des architektonischen Erbes. Das prchtige Schloss Nymphenburg mit seinen Rokokofassaden und ppigen Grten versetzt die Besucher in die Zeit der bayerischen Knige. Die hoch aufragenden Trme der Frauenkirche dominieren das Stadtbild und symbolisieren sowohl Glauben als auch Widerstandskraft. Schlendern Sie durch die charmanten Straen der Stadt, wo jede Ecke eine Geschichte von bayerischer Eleganz und Pracht erzhlt.\\n\\nMnchen hat eine Kulturszene, die sich mit den besten Europas messen kann. Kunstliebhaber knnen sich in der Alten Pinakothek verlieren, die Meisterwerke von Albrecht Drer und Rembrandt beherbergt. Die Pinakothek der Moderne hingegen widmet sich der zeitgenssischen Kunst in all ihren Formen. Die Theater und Konzerthuser der Stadt, darunter das renommierte Nationaltheater und der Gasteig, zeigen Auffhrungen, die von klassischen Meisterwerken bis hin zu Avantgarde-Produktionen reichen.\"}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','caaacb58-1f96-4cc9-bf02-95676de081d7'),(6106,1306,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Nestled in the heart of Bavaria, Munich stands as a cultural jewel, seamlessly weaving together centuries-old traditions with a contemporary vibrancy that captivates both locals and visitors alike. From its iconic architecture to the lively beer gardens, Munich offers a unique blend of history, culture, and festive revelry.\\n\\nMunich\'s skyline is a testament to its rich history and commitment to preserving architectural heritage. The resplendent Nymphenburg Palace, with its rococo facades and lush gardens, transports visitors to an era of Bavarian royalty. The towering spires of Frauenkirche dominate the cityscape, symbolizing both faith and resilience. Wander through the city\'s charming streets, where each corner tells a story of Bavarian elegance and grandeur.\\n\\nMunich boasts a cultural scene that rivals the best in Europe. Art enthusiasts can lose themselves in the Alte Pinakothek, home to masterpieces by the likes of Albrecht Drer and Rembrandt. The Pinakothek der Moderne, on the other hand, embraces contemporary art in all its forms. The city\'s theaters and concert halls, including the renowned National Theatre and the Gasteig, showcase performances that range from classical masterpieces to avant-garde productions.\"}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','87fbe622-3c45-471f-afb8-3b5c3fa8390c'),(6107,1306,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Situata nel cuore della Baviera, Monaco di Baviera  un gioiello culturale che intreccia perfettamente tradizioni secolari con una vivacit contemporanea che affascina sia gli abitanti che i visitatori. Dalla sua architettura iconica alle vivaci birrerie all\'aperto, Monaco offre una miscela unica di storia, cultura e festa.\\n\\nLo skyline di Monaco di Baviera  una testimonianza della sua ricca storia e del suo impegno nel preservare il patrimonio architettonico. Lo splendido Palazzo di Nymphenburg, con le sue facciate rococ e i suoi giardini lussureggianti, trasporta i visitatori in un\'epoca di regalit bavarese. Le guglie svettanti della Frauenkirche dominano il paesaggio urbano, simboleggiando sia la fede che la resistenza. Passeggiate per le affascinanti strade della citt, dove ogni angolo racconta una storia di eleganza e grandezza bavarese.\\n\\nMonaco vanta una scena culturale che rivaleggia con le migliori d\'Europa. Gli appassionati d\'arte possono perdersi nella Alte Pinakothek, che ospita capolavori di Albrecht Drer e Rembrandt. La Pinakothek der Moderne, invece, abbraccia l\'arte contemporanea in tutte le sue forme. I teatri e le sale da concerto della citt, tra cui il rinomato Teatro Nazionale e il Gasteig, ospitano spettacoli che spaziano dai capolavori classici alle produzioni d\'avanguardia.\"}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','aaa1cbad-012f-4bcd-8d27-d92bc73070fe'),(6108,1307,10,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \" \", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','89035067-5cae-4c84-83a2-2c19244b5ada'),(6109,1307,7,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Schlo Nymphenburg\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','514f4cc1-3262-4e90-a14e-d749bcb15986'),(6110,1307,8,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Nymphenburg Palace\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','e20b8bfd-cf18-42b3-95df-e772e170caaa'),(6111,1307,9,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Palazzo di Nymphenburg\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','60dbffaf-dcc9-4808-bc9b-4532f7cb358e'),(6112,1308,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"    ,          .       ,   ,   ,   .  ,      Hofbruhaus              .\\n\\n      ,       .    Viktualienmarkt     ,     .                  .\\n\\n,        .      ,   ,      ,         ,   .          ,          . ! :beers:\"}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','0a832c48-ea66-49d2-9b45-0dbf1f0cd0d0'),(6113,1308,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Mnchen ist ein Synonym fr das Oktoberfest, das grte Volksfest der Welt, das jedes Jahr Millionen von Besuchern anlockt. Die Stadt verwandelt sich in ein lebendiges Fest der bayerischen Kultur, mit traditioneller Musik, kstlicher Kche und natrlich dem besten Bier. ber das Oktoberfest hinaus bieten Mnchens Biergrten wie das berhmte Hofbruhaus eine authentische Verkostung der einheimischen Biere und eine gesellige Atmosphre, die die bayerische Lebensart ausmacht.\\n\\nDie kulinarische Landschaft Mnchens ist ein gastronomisches Abenteuer, bei dem traditionelle bayerische Gerichte durch internationale Einflsse ergnzt werden. Von den deftigen Wrstchen auf dem Viktualienmarkt bis hin zu den Michelin-Sternerestaurants bietet die Stadt alles, was das Herz begehrt. Verpassen Sie nicht die Gelegenheit, eine Brezn zu probieren oder sich ein Stck Apfelstrudel zu gnnen, whrend Sie die Stadt erkunden.\\n\\nIn Mnchen verschmelzen Vergangenheit und Gegenwart und schaffen eine Atmosphre, die sowohl bezaubernd als auch dynamisch ist. Ob Sie ber historische Pltze schlendern, in kulturelle Schtze eintauchen oder in einem belebten Biergarten einen Krug heben - Mnchen ldt Sie ein, die harmonische Mischung aus Tradition, Kultur und festlicher Stimmung zu erleben. Begleiten Sie uns, wenn wir die Ecken und Winkel dieses bayerischen Wandteppichs erkunden, wo jeder Moment ein Fest des zeitlosen Reizes Mnchens ist. Prost! :beers:\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','c6b15180-e1ce-4df0-9ba3-5516f207f4f6'),(6114,1308,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Munich is synonymous with Oktoberfest, the world\'s largest Volksfest that attracts millions of visitors every year. The city transforms into a lively celebration of Bavarian culture, complete with traditional music, delicious cuisine, and of course, the finest beer. Beyond Oktoberfest, Munich\'s beer gardens like the famous Hofbruhaus offer an authentic taste of local brews and a convivial atmosphere that defines the Bavarian way of life.\\n\\nMunich\'s culinary landscape is a gastronomic adventure, with traditional Bavarian fare complemented by international influences. From the hearty sausages of Viktualienmarkt to the Michelin-starred restaurants, the city caters to diverse palates. Don\'t miss the chance to savor a pretzel or indulge in a delectable slice of Apfelstrudel while exploring the city.\\n\\nIn Munich, the past and present coalesce, creating an atmosphere that is both enchanting and dynamic. Whether you\'re strolling through historic squares, immersing yourself in cultural treasures, or raising a stein in a bustling beer garden, Munich invites you to experience the harmonious blend of tradition, culture, and festive cheer. Join us as we explore the nooks and crannies of this Bavarian tapestry, where each moment is a celebration of Munich\'s timeless allure. Prost! :beers:\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','e6d31c68-285e-4634-8140-1a2195abe278'),(6115,1308,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Monaco di Baviera  sinonimo di Oktoberfest, la pi grande festa popolare del mondo che attira ogni anno milioni di visitatori. La citt si trasforma in una vivace celebrazione della cultura bavarese, con musica tradizionale, cucina deliziosa e, naturalmente, la migliore birra. Oltre all\'Oktoberfest, le birrerie all\'aperto di Monaco, come la famosa Hofbruhaus, offrono un assaggio autentico delle birre locali e un\'atmosfera conviviale che definisce lo stile di vita bavarese.\\n\\nIl paesaggio culinario di Monaco  un\'avventura gastronomica, con piatti tradizionali bavaresi integrati da influenze internazionali. Dalle sostanziose salsicce del Viktualienmarkt ai ristoranti stellati Michelin, la citt si rivolge a palati diversi. Non perdete l\'occasione di assaporare un pretzel o di concedervi una deliziosa fetta di Apfelstrudel mentre esplorate la citt.\\n\\nA Monaco di Baviera, passato e presente si fondono, creando un\'atmosfera incantevole e dinamica. Che si tratti di passeggiare per le piazze storiche, di immergersi nei tesori culturali o di innalzare uno stein in una vivace birreria all\'aperto, Monaco vi invita a sperimentare l\'armoniosa miscela di tradizione, cultura e allegria festosa. Unitevi a noi per esplorare gli angoli e le fessure di questo arazzo bavarese, dove ogni momento  una celebrazione del fascino senza tempo di Monaco. Prost! :beers:\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','1e574d59-ee02-403b-b402-3fb31249b2f7'),(6116,1309,10,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"  \", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','35f2710e-e286-4ddb-96c2-d2c7ac71125f'),(6117,1309,7,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Israelisches Zentrum Mnchen\",