 Mglichkeit, an Fhrungen teilzunehmen, um mehr ber die Geschichte der jdischen Gemeinschaft in Mnchen zu erfahren und die Bedeutung der Synagoge als Ort des Gebets, der Bildung und des Dialogs zu erleben. Die Mnchener Synagoge ist somit nicht nur ein architektonisches Meisterwerk, sondern auch ein lebendiges Zeugnis fr die Vielfalt und Offenheit der Stadt.\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','9fc2242d-1691-4292-bb05-ced2c462defa'),(6122,1310,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"The Munich Synagogue, an architectural jewel in the heart of the Bavarian capital, shines as a symbol of the Jewish community and its cultural heritage. The synagogue was inaugurated in 2006 and impresses with its modern aesthetics, which are nevertheless deeply rooted in history and tradition. The building, designed by renowned architects Wandel Hoefer Lorch + Hirsch, harmoniously combines elements of Judaism with contemporary design. The clean lines and transparency of the glass faade create an inviting atmosphere that invites visitors to discover the rich history and vibrant present of Jewish culture.\\n\\nThe synagogue is not only a religious center, but also a place of encounter and intercultural exchange. The community regularly organizes events, lectures and cultural activities that bring people from different backgrounds together. Visitors have the opportunity to take part in guided tours to learn more about the history of the Jewish community in Munich and experience the importance of the synagogue as a place of prayer, education and dialog. The Munich Synagogue is therefore not only an architectural masterpiece, but also a living testimony to the diversity and openness of the city.\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','9b7c8598-093c-45a1-b1c6-12ad1de08edb'),(6123,1310,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"La Sinagoga di Monaco, gioiello architettonico nel centro della capitale bavarese, brilla come simbolo della comunit ebraica e del suo patrimonio culturale. Inaugurata nel 2006, la sinagoga colpisce per la sua estetica moderna, ma profondamente radicata nella storia e nella tradizione. L\'edificio, progettato dai famosi architetti Wandel Hoefer Lorch + Hirsch, combina armoniosamente elementi dell\'ebraismo con il design contemporaneo. Le linee pulite e la trasparenza della facciata in vetro creano un\'atmosfera invitante che invita i visitatori a scoprire la ricca storia e il vibrante presente della cultura ebraica.\\n\\nLa sinagoga non  solo un centro religioso, ma anche un luogo di incontro e scambio interculturale. La comunit organizza regolarmente eventi, conferenze e attivit culturali che riuniscono persone di diversa provenienza. I visitatori hanno la possibilit di partecipare a visite guidate per conoscere meglio la storia della comunit ebraica di Monaco e sperimentare l\'importanza della sinagoga come luogo di preghiera, educazione e dialogo. La Sinagoga di Monaco non  quindi solo un capolavoro architettonico, ma anche una testimonianza vivente della diversit e dell\'apertura della citt.\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','f52be29d-8103-4f65-89c7-17735a407d4e'),(6134,23,12,'Example 59',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-12-03 15:10:44','2023-12-03 15:10:44','179cc1c3-2de4-4216-bee1-477b75a4b4fe'),(6136,25,12,'Example 61',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-12-03 15:10:44','2023-12-03 15:10:44','0302f6be-f009-4a8f-b182-bb02e62515cf'),(6138,31,12,'Example 10',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-12-03 15:10:44','2023-12-03 15:10:44','115a85f3-16da-4408-ba03-8b5fe6feb73f'),(6139,104,12,'Example 12',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-92