butikler ve gelien bir sanat ortam sunan bir kltrler eritme potasdr. Yerel halkn piknik ve canl mzik iin bir araya geldii Grlitzer Park\' kefedin veya her keyi ssleyen canl sokak sanat karsnda bylenin. Kreuzberg, Berlin\'in tarihi gemii ile ilerici ve ileri grl bugnn kusursuz bir ekilde harmanlama becerisinin bir kantdr.\\n\\nAkamlar Berlin\'in efsanevi gece hayatnn tadn karabilirsiniz. Berghain gibi tekno tapnaklarndan samimi caz kulplerine ve tarihi bira bahelerine kadar ehir hava karardktan sonra canlanr. Kendinizi elektronik mzik sahnesinin titreen ritmine brakn ya da elinizde bir birayla rahat bir barda dinlenin - Berlin\'in gece hayat herkes iin bir eyler sunar.\\n\\nBerlin, tarih ve modernlik ikilemiyle benzersiz ve zenginletirici bir seyahat deneyimi vaat ediyor. ster ehrin ikonik simgelerinden bylenmi, ister karmak tarihiyle ilgileniyor ya da modern cazibesiyle bylenmi olun, Berlin sizi gemiini kucaklarken gelecei kollarn aarak karlayan bir ehri kefetmeye davet ediyor.\"}',1,'2023-12-03 15:11:39','2023-12-03 15:11:39','60f5fc95-62aa-44cb-be78-ebbf78f3676c'),(6267,139,12,'Bizim Dergimiz','bizim-dergimiz','bizim-dergimiz','{\"bd99bd78-f4c9-4e15-83ca-230c2479d384\": false, \"c05ea8a3-0b6b-41f7-87be-c356ee495284\": \"Im Grunewald 18\\n\\nBerlin\"}',1,'2023-12-03 15:12:26','2023-12-03 21:07:24','65753b3f-91fc-47d0-84a2-5f99b7e05584'),(6268,142,12,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \" Welcome to the vibrant tapestry of culture, innovation, and history that is at the heart of our city magazine, capturing the essence of remarkable German destinations.\\n\\n __Berlin - Tarihin Moderniteyle Bulutuu Yer:__\\n\\nHer sokak kesinin zengin bir gemiin hikyelerini fsldad Berlin\'in dinamik enerjisine daln. konik Brandenburg Kaps\'ndan East Side Gallery\'nin eklektik sokak sanatna kadar Berlin, tarihi avangart yaratclkla zahmetsizce birletiren bir ehirdir. Gizli mcevherleri ortaya karn, farkl mahalleleri kefedin ve Berlin\'i kltrel bir kaleydoskop yapan gelenek ve yeniliin karmnn tadn karn.\\n\\n\\n __Mnih - Bavyera kl ve Oktoberfest enlii:__\\n\\nBavyera geleneini modern cazibeyle zahmetsizce harmanlayan bir ehir olan Mnih\'in zengin dokusuna kendinizi brakn. Nymphenburg Saray\'nn ihtiam ve Frauenkirche\'nin ikonik kuleleri gibi mimari mcevherlerle bezenmi byleyici sokaklarda dolan. Mnih\'in canl kltrel ortam sizi birinci snf mzeleri kefetmeye davet ederken, hareketli bira baheleri ve geleneksel bira imalathaneleri sizi Oktoberfest\'in i ac ruhunu yaamaya aryor. ster Residenz\'in klasik zarafetiyle bylenmi olun, ister Viktualienmarkt\'n neeli atmosferine kendinizi kaptrn, Mnih tarihin, kltrn ve hayatn neeli kutlamalarnn uyumlu bir ekilde bir arada var olduunun kantdr. Her an sofistike ve elencenin keyifli bir karm olan bu Bavyera metropolnde bir yolculua karken bize katln. \\n\\n __Hamburg - Sonsuz Olaslklar Liman:__\\n\\nDenizcilik ruhunu kollarn aarak kucaklayan Hamburg\'a yelken an. Elbphilharmonie\'nin cazibesini kefedin, Speicherstadt\'n hareketli sahilinde dolan ve Hamburg\'un kozmopolit cazibesini yanstan canl mahallelerde kendinizi kaybedin. Dergimiz, bu Hansa mcevherinin denizcilik hikayeleri, gastronomik lezzetleri ve srekli gelien kltrel manzarasnda gezinmeniz iin pusulanzdr.\\n\\n __Soltau - Doann Cenneti Heath\'te:__\\n\\nDoann n plana kt Soltau\'nun huzurlu kucana kan. Lneburg Heath\'in byleyici manzaralarn kefedin, Soltau Heathland\'in gr yeilliklerinde geveyin ve hayatn basit zevklerinin tadn karn. Dergimiz sizi, Soltau\'yu doada inzivaya ekilmek isteyenler iin bir cennet haline getiren gizli cevherleri, ak hava maceralarn ve sakin gzellii kefetmeye davet ediyor.\\n\\n\\n Sayfalarmzda, bu ehirlerin ruhunu sergileyen hikayeler, zellikler ve igrlerden oluan seilmi bir koleksiyon bulacaksnz. ster bir sakin ister merakl bir ziyareti olun, ehirlerin eitli dokularnda bir yolculukta bize katln. Bu inanlmaz destinasyonlarn nabzn kefederken, kutlarken ve ortaya karrken gemiye ho geldiniz!  \\n\\n\\\\#CityVibesMagazine #DiscoverBerlinHamburgSoltau\"}',1,'2023-12-03 15:12:26','2024-03-26 11:00:23','b7d6be95-98bc-4bea-9b38-c2e0584436e6'),(6269,234,12,'Arama','search','search','{\"84760a94-cb38-424c-89e3-94ec494bf991\": false}',1,'2023-12-03 15:12:26','2023-12-03 15:19:44','2fa513f4-a85f-4bb4-bc24-fbb1a288db04'),(6270,302,12,'Konular','konular','konular','{\"1be82713-a59c-499a-83b6-f3bfcb21c646\": true}',1,'2023-12-03 15:12:26','2023-12-03 21:08:00','33f818d6-9ae4-4ab7-92bb-9bd11d640c82'),(6271,348,12,'Makaleler','makaleler','makaleler','{\"130dff67-c8fe-4e57-bd48-4275a86b9c11\": true}',1,'2023-12-03 15:12:27','2023-12-03 21:07:38','bfae0a9f-47ea-4063-b388-b9e581f7ac5a'),(6272,1120,12,'Konumlar','konumlar','konumlar','{\"45faead8-c280-4936-9ddf-3a3ec2d07a52\": true}',1,'2023-12-03 15:12:27','2023-12-03 21:08:12','f229ff9d-0d4d-4392-83e0-c231bbde00d1'),(6310,4,12,'Ana sayfa','home','__home__','{\"c1940a37-f8d1-4445-a880-101255bfabe5\": \"Berlin iin ehir derginiz - gerekten harika!\"}',1,'2023-12-03 15:13:46','2023-12-03 15:13:46','7eb18ae9-e193-45a0-9472-1827b381229d'),(6322,1,12,'Site Info - Global Settings','site-info-global-settings',NULL,'{\"0b7b855c-3f2f-4d39-8ef0-e5fccd7a2685\": \"CityMag\", \"c544e80e-5800-4486-82be-1c01d88af25f\": false, \"c5b5269f-b571-4e25-af4c-6cdfdc2fbf56\": \"Perlen vor die Sue GmbH\"}',1,'2023-12-03 15:14:12','2023-12-03 15:14:12','05cc51df-7800-4e4d-b7f4-afd447b3e809'),(6384,1324,12,'Berlin\'i kefedin: Tarih ve modernliin senfonisi','berlini-kesfedin-tarih-ve-modernligin-senfonisi','Mmkaleler/berlini-kesfedin-tarih-ve-modernligin-senfonisi','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','7c2b1dc7-246d-44d9-93fa-51fa5822a8c2'),(6385,1324,1,'Exploring Berlin: A Symphony of History and Modernity','exploring-berlin-a-symphony-of-history-and-modernity','articles/exploring-berlin-a-symphony-of-history-and-modernity','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','52eebb76-8482-4861-aa58-9f308559231c'),(6386,1324,2,'Berlin erkunden: Eine Symphonie aus Geschichte und Moderne','berlin-erkunden-eine-symphonie-aus-geschichte-und-moderne','artikel/berlin-erkunden-eine-symphonie-aus-geschichte-und-moderne','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','cdc5a027-1e97-4479-8319-d54ba6715999'),(6387,1324,11,'  ','--','/--','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','559bed8c-d6e8-4670-b711-99e799dbb090'),(6388,1325,12,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Almanya\'nn canl bakenti Berlin, sokaklarnda dolaacak kadar ansl olan tm gezginleri byleyen modern, dinamik bir enerjiyle zengin bir tarihi zahmetsizce harmanlyor. alkantl bir gemiin ardndan Berlin, dayankll, eitlilii ve yaratcl kutlayan bir ehre dnmtr. Tarihi simge yaplardan canl ve popler mahallelere kadar Berlin, unutulmaz bir yolculuk vaat eden byleyici bir destinasyondur.\\n\\nKefinize Almanya\'nn yeniden birlemesinin sembol olan Brandenburg Kaps\'ndan balayn. Bu grkemli neoklasik ant ehrin kalbinde gururla durmakta ve mzeler, saraylar ve byleyici kafelerle kapl tarihi bir bulvar olan Unter den Linden\'e alan kapy oluturmaktadr. Brandenburg Kaps\'nda gnn farkl saatlerinde dolan ve dntrc gzelliini deneyimleyin - gn doumunun scak nda veya gece gkyznn nda, huu duygusu uyandrmakta asla baarsz olmaz.\\n\\nDnyann drt bir yanndan sanatlarn yz akn duvar resmiyle sslenmi Berlin Duvar\'nn yaayan bir blm olan Dou Yakas Galerisi\'ni ziyaret ederek kendinizi Berlin\'in karmak tarihine brakn. Her bir duvar resmi, bir zamanlar blnm olan bir ehrin umutlarn, mcadelelerini ve zaferlerini yanstan kendi hikayesini anlatyor. Bu ak hava galerisinde yrrken, gemiin yanklarn ve bugn Berlin\'i karakterize eden direnli ruhu hissedeceksiniz.\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','fafed475-769d-48c2-92d7-1ef775aa79bc'),(6389,1325,1,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Berlin, the vibrant capital of Germany, effortlessly blends a rich tapestry of history with a modern, dynamic energy that captivates every traveler lucky enough to wander its streets. Steeped in a tumultuous past, Berlin has emerged as a city that celebrates resilience, diversity, and creativity. From iconic historical landmarks to trendy neighborhoods pulsating with life, Berlin is a captivating destination that promises an unforgettable journey.\\n\\nBegin your exploration at the iconic Brandenburg Gate, an enduring symbol of German reunification. This majestic neoclassical monument stands proudly at the heart of the city, providing a gateway to Unter den Linden, a historic boulevard lined with museums, palaces, and charming cafes. Wander through the Brandenburg Gate at different times of the day to witness its transformative beauty  bathed in the warm glow of sunrise or illuminated against the night sky, it never fails to evoke a sense of awe.\\n\\nDelve into Berlin\'s complex history with a visit to the East Side Gallery, a vibrant stretch of the Berlin Wall adorned with over a hundred murals by artists from around the world. Each mural tells a unique story, reflecting the hope, struggles, and triumphs of a city that once stood divided. As you stroll along this open-air gallery, you\'ll feel the echoes of the past and the resilient spirit that now defines Berlin.\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','1231c952-76a6-4017-a778-41309df90ad5'),(6390,1325,2,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Berlin, die pulsierende Hauptstadt Deutschlands, verbindet mhelos eine reiche Geschichte mit einer modernen, dynamischen Energie, die jeden Reisenden, der das Glck hat, durch ihre Straen zu wandern, in ihren Bann zieht. Nach einer turbulenten Vergangenheit hat sich Berlin zu einer Stadt entwickelt, die Widerstandsfhigkeit, Vielfalt und Kreativitt zelebriert. Von historischen Wahrzeichen bis hin zu pulsierenden Szenevierteln ist Berlin ein fesselndes Reiseziel, das eine unvergessliche Reise verspricht.\\n\\nBeginnen Sie Ihre Erkundungstour am Brandenburger Tor, dem Wahrzeichen der deutschen Wiedervereinigung. Dieses majesttische neoklassizistische Monument steht stolz im Herzen der Stadt und bildet das Tor zu Unter den Linden, einem historischen Boulevard, der von Museen, Palsten und charmanten Cafs gesumt ist. Schlendern Sie zu verschiedenen Tageszeiten durch das Brandenburger Tor und erleben Sie seine verwandelnde Schnheit - im warmen Licht des Sonnenaufgangs oder im Licht des Nachthimmels erweckt es immer wieder ein Gefhl der Ehrfurcht.\\n\\nTauchen Sie in die komplexe Geschichte Berlins ein, indem Sie die East Side Gallery besuchen, einen lebendigen Abschnitt der Berliner Mauer, der mit ber hundert Wandmalereien von Knstlern aus aller Welt geschmckt ist. Jedes Wandbild erzhlt eine eigene Geschichte und spiegelt die Hoffnung, die Kmpfe und die Triumphe einer Stadt wider, die einst geteilt war. Bei einem Spaziergang durch diese Open-Air-Galerie werden Sie das Echo der Vergangenheit und den unverwstlichen Geist spren, der Berlin heute prgt.\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','db91e0c9-a1ba-4270-9e95-7c74af029481'),(6391,1325,11,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"\\n\\n\\n\\n100\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','c3432585-03fa-4c5d-9448-890be104fe52'),(6392,1326,12,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Berlin Duvar\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','18ea6252-4122-429c-a2a0-9a936974d26a'),(6393,1326,1,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Berliner Mauer\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','e16eafe3-3a22-4c59-b59b-41aaf725b356'),(6394,1326,2,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Berliner Mauer\", \"d2dbe0c8