in the vibrant street art that adorns every corner. Kreuzberg is a testament to Berlin\'s ability to seamlessly blend its storied past with a progressive, forward-thinking present.\\n\\nIn the evening, savor Berlin\'s legendary nightlife. From techno temples like Berghain to intimate jazz clubs and historic beer gardens, the city comes alive after dark. Immerse yourself in the pulsating beats of the electronic music scene or unwind in a cozy bar with a craft beer in hand  Berlin\'s nightlife caters to every taste.\\n\\nBerlin, with its dichotomy of history and modernity, promises a unique and enriching travel experience. Whether you\'re captivated by its iconic landmarks, intrigued by its complex history, or enchanted by its contemporary charm, Berlin invites you to explore a city that has embraced its past while embracing the future with open arms.\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','f0500b30-0361-4e1f-aba7-91d132e2f74c'),(6398,1327,2,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Wenn Sie einen Vorgeschmack auf die moderne Lebendigkeit der Stadt haben mchten, besuchen Sie Kreuzberg. Dieser eklektische Bezirk ist ein Schmelztiegel der Kulturen, der eine vielfltige kulinarische Szene, trendige Boutiquen und eine blhende Kunstszene zu bieten hat. Erkunden Sie den Grlitzer Park, wo sich die Einheimischen zum Picknick und zu Live-Musik treffen, oder lassen Sie sich von der lebendigen Straenkunst verzaubern, die jede Ecke ziert. Kreuzberg ist ein Beweis fr die Fhigkeit Berlins, seine geschichtstrchtige Vergangenheit nahtlos mit einer fortschrittlichen, zukunftsorientierten Gegenwart zu verbinden.\\n\\nAm Abend knnen Sie das legendre Berliner Nachtleben genieen. Von Techno-Tempeln wie dem Berghain bis hin zu intimen Jazzclubs und historischen Biergrten erwacht die Stadt nach Einbruch der Dunkelheit zum Leben. Tauchen Sie ein in die pulsierenden Beats der elektronischen Musikszene oder entspannen Sie sich in einer gemtlichen Bar mit einem Craft Beer in der Hand - das Berliner Nachtleben bietet fr jeden Geschmack etwas.\\n\\nBerlin, mit seiner Dichotomie aus Geschichte und Moderne, verspricht eine einzigartige und bereichernde Reiseerfahrung. Ganz gleich, ob Sie von den ikonischen Wahrzeichen der Stadt fasziniert sind, sich fr ihre komplexe Geschichte interessieren oder sich von ihrem modernen Charme verzaubern lassen - Berlin ldt Sie ein, eine Stadt zu erkunden, die sich ihrer Vergangenheit stellt und gleichzeitig die Zukunft mit offenen Armen empfngt.\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','ab49358c-c21b-4e90-b7c6-2c9136b9bdbd'),(6399,1327,11,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"\\n\\n\\n\\n\"}',1,'2023-12-03 15:17:12','2023-12-03 15:17:12','31cb47fd-0d56-4dfe-a1c4-254eed8d8f44'),(6543,671,12,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"ehre ksa bir giri\"}',1,'2023-12-03 21:09:02','2023-12-03 21:09:02','4062e1fa-cecc-4471-97cd-57f891947c9f'),(6544,629,12,'Giri','giris','konular/giris',NULL,1,'2023-12-03 21:09:04','2023-12-03 21:09:43','7f19cd10-696a-493a-958f-dbf423c7a647'),(6577,310,12,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Sadece tantm amaldr\"}',1,'2023-12-03 21:09:12','2023-12-03 21:09:12','0dabbfdb-b70b-41a6-bcb4-9605ca3f0f48'),(6578,272,12,'Demo','demo','konular/demo',NULL,1,'2023-12-03 21:09:14','2023-12-03 21:09:14','b2f455a5-4e74-4efe-a8c6-b7fe70e3640c'),(6602,335,12,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Vahilemek\"}',1,'2023-12-03 21:09:24','2023-12-03 21:09:24','c7d02fa3-8620-4b68-b2c5-08035a9e17ea'),(6603,331,12,'Halli Galli','halli-galli','konular/halli-galli',NULL,1,'2023-12-03 21:09:26','2023-12-03 21:09:26','5cf5ea9c-4d93-4634-9e0f-b2671cd5d334'),(6700,1359,12,'Halli Galli','halli-galli','konular/halli-galli',NULL,1,'2023-12-03 21:10:27','2023-12-03 21:10:27','814576a0-216f-41e0-bb40-1ab643d562bb'),(6701,1359,1,'Halli Galli','halli-galli','topics/halli-galli',NULL,1,'2023-12-03 21:10:27','202