'our-magazine','our-magazine','{\"bd99bd78-f4c9-4e15-83ca-230c2479d384\": false, \"c05ea8a3-0b6b-41f7-87be-c356ee495284\": \"Im Grunewald 18\\n\\nBerlin\"}',1,'2023-12-03 21:53:49','2023-12-03 21:53:49','b644dea1-5865-4352-93f8-d231ba58517a'),(7118,1401,11,'','','','{\"bd99bd78-f4c9-4e15-83ca-230c2479d384\": false, \"c05ea8a3-0b6b-41f7-87be-c356ee495284\": \"Im Grunewald 18\\n\\nBerlin\"}',1,'2023-12-03 21:53:49','2023-12-03 21:53:49','f839583f-6df0-4f10-9610-8f29a4bd061a'),(7119,1401,12,'Bizim Dergimiz','bizim-dergimiz','bizim-dergimiz','{\"bd99bd78-f4c9-4e15-83ca-230c2479d384\": false, \"c05ea8a3-0b6b-41f7-87be-c356ee495284\": \"Im Grunewald 18\\n\\nBerlin\"}',1,'2023-12-03 21:53:49','2023-12-03 21:53:49','76d86bc6-2bbf-41c3-b080-aaf6db1ae08c'),(7120,1402,13,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \":tada: --\\n\\n:cityscape: __--:__\\n\\nEast Side Gallery\\n\\n\\n:beers: __--:__\\n\\nNymphenburg PalaceFrauenkircheResidenzViktualienmarkt :pretzel:\\n\\n:water_wave: __--:__\\n\\n\\n\\n:deciduous_tree: __--:__\\n\\n\\n\\n\\n:open_book:  :earth_europe::camera_with_flash: \\n\\n\\\\#CityVibesMagazine #DiscoverBerlinHamburgSoltau\"}',1,'2023-12-03 21:53:49','2023-12-03 21:53:49','7f947689-53b2-471c-b60b-f8ecd9403403'),(7121,1402,1,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \":tada: Welcome to the vibrant tapestry of culture, innovation, and history that is at the heart of our city magazine, capturing the essence of remarkable German destinations.\\n\\n:cityscape: __Berlin - Where History Meets Modernity:__\\n\\nDive into the dynamic energy of Berlin, where every street corner whispers tales of a rich past. From the iconic Brandenburg Gate to the eclectic street art of East Side Gallery, Berlin is a city that effortlessly marries history with avant-garde creativity. Uncover hidden gems, explore diverse neighborhoods, and savor the blend of tradition and innovation that makes Berlin a cultural kaleidoscope.\\n\\n\\n:beers: __Munich - Bavarian Elegance and Oktoberfest Revelry:__\\n\\nImmerse yourself in the rich tapestry of Munich, a city that effortlessly blends Bavarian tradition with modern allure. Wander through the charming streets adorned with architectural gems, such as the grandeur of Nymphenburg Palace and the iconic spires of Frauenkirche. Munich\'s vibrant cultural scene invites you to explore world-class museums, while its lively beer gardens and traditional breweries beckon you to indulge in the heartwarming spirit of Oktoberfest. Whether you\'re captivated by the classical elegance of the Residenz or swept up in the jovial atmosphere of Viktualienmarkt, Munich stands as a testament to the harmonious coexistence of history, culture, and the joyous celebration of life. Join us on a journey through this Bavarian metropolis, where every moment is a delightful blend of sophistication and revelry. :pretzel:\\n\\n:water_wave: __Hamburg - The Harbor of Endless Possibilities:__\\n\\nSet sail for Hamburg, a city that embraces its maritime spirit with open arms. Discover the allure of the Elbphilharmonie, stroll along the bustling waterfront of the Speicherstadt, and lose yourself in the vibrant neighborhoods that reflect Hamburg\'s cosmopolitan charm. Our magazine is your compass to navigate through the maritime tales, gastronomic delights, and the ever-evolving cultural landscape of this Hanseatic gem.\\n\\n:deciduous_tree: __Soltau - Nature\'s Haven in the Heath:__\\n\\nEscape to the tranquil embrace of Soltau, where nature takes center stage. Explore the enchanting landscapes of the Lneburg Heath, unwind in the lush greenery of the Soltau Heathland, and indulge in the simple pleasures of life. Our magazine invites you to discover the hidden gems, outdoor adventures, and the serene beauty that make Soltau a haven for those seeking a retreat into nature.\\n\\n\\n:open_book: In our pages, you will find a curated collection of stories, features, and insights that showcase the spirit of these cities. Whether you\'re a resident or a curious visitor, join us on a journey through the diverse tapestry of the cities. Welcome aboard as we explore, celebrate, and uncover the pulse of these incredible destinations! :earth_europe::camera_with_flash: \\n\\n\\\\#CityVibesMagazine #DiscoverBerlinHamburgSoltau\"}',1,'2023-12-03 21:53:49','2023-12-03 21:53:49','684428e9-56bc-4355-b389-3bbc8d6d9bca'),(7122,1402,2,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \":tada: Willkommen in der lebendigen Mischung aus Kultur, Innovation und Geschichte, die das Herzstck unseres Stadtmagazins bildet und die Essenz von bemerkenswerten deutschen Reisezielen einfngt.\\n\\n:cityscape: __Berlin - Wo Geschichte auf Moderne trifft:__\\n\\nTauchen Sie ein in die dynamische Energie Berlins, wo an jeder Straenecke Geschichten aus einer reichen Vergangenheit erzhlt werden. Vom ikonischen Brandenburger Tor bis zur eklektischen Straenkunst der East Side Gallery - Berlin ist eine Stadt, die mhelos Geschichte mit avantgardistischer Kreativitt verbindet. Entdecken Sie verborgene Juwelen, erkunden Sie verschiedene Stadtteile und genieen Sie die Mischung aus Tradition und Innovation, die Berlin zu einem kulturellen Kaleidoskop macht.\\n\\n:beers: __Mnchen - Bayerische Eleganz und Oktoberfeststimmung:__\\n\\nTauchen Sie ein in das reiche Bild Mnchens, einer Stadt, die mhelos bayerische Tradition mit modernem Charme verbindet. Schlendern Sie durch die charmanten Straen, die mit architektonischen Schmuckstcken wie dem prachtvollen Schloss Nymphenburg und den ikonischen Trmen der Frauenkirche geschmckt sind. Die pulsierende Kulturszene Mnchens ldt zu einem Besuch der Museen von Weltrang ein, whrend die lebhaften Biergrten und traditionellen Brauereien dazu einladen, sich dem herzerwrmenden Geist des Oktoberfestes hinzugeben. Ob Sie sich von der klassischen Eleganz der Residenz verzaubern lassen oder sich von der heiteren Atmosphre des Viktualienmarktes mitreien lassen, Mnchen ist ein Zeugnis fr das harmonische Nebeneinander von Geschichte, Kultur und Lebensfreude. Begleiten Sie uns auf eine Reise durch diese bayerische Metropole, in der jeder Moment eine reizvolle Mischung aus Raffinesse und Lebensfreude ist. :pretzel:\\n\\n:water_wave: __Hamburg - Der Hafen der unbegrenzten Mglichkeiten:__\\n\\nSetzen Sie die Segel in Richtung Hamburg, eine Stadt, die ihren maritimen Geist mit offenen Armen empfngt. Entdecken Sie die Faszination der Elbphilharmonie, schlendern Sie entlang der belebten Uferpromenade der Speicherstadt und tauchen Sie ein in die pulsierenden Stadtteile, die Hamburgs kosmopolitischen Charme widerspiegeln. Unser Magazin ist Ihr Kompass, um durch die maritimen Geschichten, die gastronomischen Gensse und die sich stndig verndernde Kulturlandschaft der Hansestadt zu navigieren.\\n\\n:deciduous_tree: __Soltau - Naturparadies in der Heide:__\\n\\nEntfliehen Sie in die ruhige Umarmung von Soltau, wo die Natur die Hauptrolle spielt. Erkunden Sie die zauberhaften Landschaften der Lneburger Heide, entspannen Sie sich im ppigen Grn der Soltauer Heide und genieen Sie die einfachen Freuden des Lebens. Unser Magazin ldt Sie ein, die versteckten Schtze, die Abenteuer in der Natur und die ruhige Schnheit zu entdecken, die Soltau zu einem Rckzugsort fr alle machen, die sich in die Natur zurckziehen mchten.\\n\\n\\n:open_book: Auf unseren Seiten finden Sie eine kuratierte Sammlung von Geschichten, Features und Einblicken, die den Geist dieser Stdte widerspiegeln. Egal, ob Sie Einwohner oder neugieriger Besucher sind, begleiten Sie uns auf eine Reise durch die vielfltigen Facetten der Stdte. Willkommen an Bord, wenn wir den Puls dieser unglaublichen Reiseziele erforschen, feiern und aufdecken! :earth_europe::camera_with_flash: \\n\\n\\\\#CityVibesMagazine #DiscoverBerlinHamburgSoltau\"}',1,'2023-12-03 21:53:49','2023-12-03 21:53:49','001531ed-df77-4928-b2f2-cd480c577910'),(7123,1402,3,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \":tada: Welcom