racht erzaehlt muenchen hat eine kulturszene die sich mit den besten europas messen kann kunstliebhaber koennen sich in der alten pinakothek verlieren die meisterwerke von albrecht duerer und rembrandt beherbergt die pinakothek der moderne hingegen widmet sich der zeitgenoessischen kunst in all ihren formen die theater und konzerthaeuser der stadt darunter das renommierte nationaltheater und der gasteig zeigen auffuehrungen die von klassischen meisterwerken bis hin zu avantgarde produktionen reichen '),(584,'field',6,8,' nestled in the heart of bavaria munich stands as a cultural jewel seamlessly weaving together centuries old traditions with a contemporary vibrancy that captivates both locals and visitors alike from its iconic architecture to the lively beer gardens munich offers a unique blend of history culture and festive revelry munichs skyline is a testament to its rich history and commitment to preserving architectural heritage the resplendent nymphenburg palace with its rococo facades and lush gardens transports visitors to an era of bavarian royalty the towering spires of frauenkirche dominate the cityscape symbolizing both faith and resilience wander through the citys charming streets where each corner tells a story of bavarian elegance and grandeur munich boasts a cultural scene that rivals the best in europe art enthusiasts can lose themselves in the alte pinakothek home to masterpieces by the likes of albrecht durer and rembrandt the pinakothek der moderne on the other hand embraces contemporary art in all its forms the citys theaters and concert halls including the renowned national theatre and the gasteig showcase performances that range from classical masterpieces to avant garde productions '),(584,'field',6,9,' situata nel cuore della baviera monaco di baviera e un gioiello culturale che intreccia perfettamente tradizioni secolari con una vivacita contemporanea che affascina sia gli abitanti che i visitatori dalla sua architettura iconica alle vivaci birrerie alaperto monaco offre una miscela unica di storia cultura e festa lo skyline di monaco di baviera e una testimonianza della sua ricca storia e del suo impegno nel preservare il patrimonio architettonico lo splendido palazzo di nymphenburg con le sue facciate rococo e i suoi giardini lussureggianti trasporta i visitatori in uepoca di regalita bavarese le guglie svettanti della frauenkirche dominano il paesaggio urbano simboleggiando sia la fede che la resistenza passeggiate per le affascinanti strade della citta dove ogni angolo racconta una storia di eleganza e grandezza bavarese monaco vanta una scena culturale che rivaleggia con le migliori europa gli appassionati arte possono perdersi nella alte pinakothek che ospita capolavori di albrecht durer e rembrandt la pinakothek der moderne invece abbraccia arte contemporanea in tutte le sue forme i teatri e le sale da concerto della citta tra cui il rinomato teatro nazionale e il gasteig ospitano spettacoli che spaziano dai capolavori classici alle produzioni avanguardia '),(584,'field',6,10,'                                                                                                                  alte pinakothek            pinacotek der moderne                            '),(584,'slug',0,7,''),(584,'slug',0,8,''),(584,'slug',0,9,''),(584,'slug',0,10,''),(594,'alt',0,1,''),(594,'alt',0,2,''),(594,'alt',0,3,''),(594,'alt',0,4,''),(594,'alt',0,5,''),(594,'alt',0,6,''),(594,'alt',0,7,''),(594,'alt',0,8,''),(594,'alt',0,9,''),(594,'alt',0,10,''),(594,'alt',0,11,''),(594,'alt',0,12,''),(594,'alt',0,13,''),(594,'extension',0,1,' jpg '),(594,'extension',0,2,' jpg '),(594,'extension',0,3,' jpg '),(594,'extension',0,4,' jpg '),(594,'extension',0,5,' jpg '),(594,'extension',0,6,' jpg '),(594,'extension',0,7,' jpg '),(594,'extension',0,8,' jpg '),(594,'extension',0,9,' jpg '),(594,'extension',0,10,' jpg '),(594,'extension',0,11,' jpg '),(594,'extension',0,12,' jpg '),(594,'extension',0,13,' jpg '),(594,'field',5,