ey begin your exploration at the iconic brandenburg gate an enduring symbol of german reunification this majestic neoclassical monument stands proudly at the heart of the city providing a gateway to unter den linden a historic boulevard lined with museums palaces and charming cafes wander through the brandenburg gate at different times of the day to witness its transformative beauty bathed in the warm glow of sunrise or illuminated against the night sky it never fails to evoke a sense of awe delve into berlis complex history with a visit to the east side gallery a vibrant stretch of the berlin wall adorned with over a hundred murals by artists from around the world each mural tells a unique story reflecting the hope struggles and triumphs of a city that once stood divided as you stroll along this open air gallery youll feel the echoes of the past and the resilient spirit that now defines berlin berliner mauer for a taste of the citys modern vibrancy head to kreuzberg this eclectic neighborhood is a melting pot of cultures boasting a diverse culinary scene trendy boutiques and a thriving arts community explore gorlitzer park where locals gather to enjoy picnics and live music or lose yourself in the vibrant street art that adorns every corner kreuzberg is a testament to berlis ability to seamlessly blend its storied past with a progressive forward thinking present in the evening savor berlis legendary nightlife from techno temples like berghain to intimate jazz clubs and historic beer gardens the city comes alive after dark immerse yourself in the pulsating beats of the electronic music scene or unwind in a cozy bar with a craft beer in hand berlis nightlife caters to every taste berlin with its dichotomy of history and modernity promises a unique and enriching travel experience whether youre captivated by its iconic landmarks intrigued by its complex history or enchanted by its contemporary charm berlin invites you to explore a city that has embraced its past while embracing the future with open arms '),(620,'field',2,2,' berlin die pulsierende hauptstadt deutschlands verbindet muehelos eine reiche geschichte mit einer modernen dynamischen energie die jeden reisenden der das glueck hat durch ihre strassen zu wandern in ihren bann zieht nach einer turbulenten vergangenheit hat sich berlin zu einer stadt entwickelt die widerstandsfaehigkeit vielfalt und kreativitaet zelebriert von historischen wahrzeichen bis hin zu pulsierenden szenevierteln ist berlin ein fesselndes reiseziel das eine unvergessliche reise verspricht beginnen sie ihre erkundungstour am brandenburger tor dem wahrzeichen der deutschen wiedervereinigung dieses majestaetische neoklassizistische monument steht stolz im herzen der stadt und bildet das tor zu unter den linden einem historischen boulevard der von museen palaesten und charmanten cafes gesaeumt ist schlendern sie zu verschiedenen tageszeiten durch das brandenburger tor und erleben sie seine verwandelnde schoenheit im warmen licht des sonnenaufgangs oder im licht des nachthimmels erweckt es immer wieder ein gefuehl der ehrfurcht tauchen sie in die komplexe geschichte berlins ein indem sie die east side gallery besuchen einen lebendigen abschnitt der berliner mauer der mit ueber hundert wandmalereien von kuenstlern aus aller welt geschmueckt ist jedes wandbild erzaehlt eine eigene geschichte und spiegelt die hoffnung die kaempfe und die triumphe einer stadt wider die einst geteilt war bei einem spaziergang durch diese open air galerie werden sie das echo der vergangenheit und den unverwuestlichen geist spueren der berlin heute praegt berliner mauer wenn sie einen vorgeschmack auf die moderne lebendigkeit der stadt haben moechten besuchen sie kreuzberg dieser eklektische bezirk ist ein schmelztiegel der kulturen der eine vielfaeltige kulinarische szene trendige boutiquen und eine bluehende kunstszene zu bieten hat erkunden sie den goerlitzer park wo sich die einheimischen zum picknick und zu live musik treffen oder lassen sie sich von der lebendigen strassenkunst verzaubern die jede ecke ziert kreuzberg ist ein beweis fuer die faehigkeit berlins seine geschichtstraechtige vergangenheit nahtlos mit einer fortschrittlichen zukunftsorientierten gegenwart zu verbinden am abend koennen sie das legendaere berliner nachtleben geniessen von techno tempeln wie dem berghain bis hin zu intimen jazzclubs und historischen biergaerten erwacht die stadt nach einbruch der dunkelheit zum leben tauchen sie ein in die pulsierenden beats der elektronischen musikszene oder entspannen sie sich in einer gemuetlichen bar mit einem craft beer in der hand das berliner nachtleben bietet fuer jeden geschmack etwas berlin mit seiner dichotomie aus geschichte und moderne verspricht eine einzigartige und bereichernde reiseerfahrung ganz gleich ob sie von den ikonischen wahrzeichen der stadt fasziniert sind sich fuer ihre komplexe geschichte interessieren oder sich von ihrem modernen charme verzaubern lassen berlin laedt sie ein eine stadt zu erkunden die sich ihrer vergangenheit stellt und gleichzeitig die zukunft mit offenen armen empfaengt '),(620,'field',2,11,'   100  CNY   '),(620,'field',2,12,' almanyanin canli baskenti berlin sokaklarinda dolasacak kadar sansli olan tum gezginleri buyuleyen modern dinamik bir enerjiyle zengin bir tarihi zahmetsizce harmanliyor calkantili bir gecmisin ardindan berlin dayanikliligi cesitliligi ve yaraticiligi kutlayan bir sehre donusmustur tarihi simge yapilardan canli ve populer mahallelere kadar berlin unutulmaz bir yolculuk vaat eden buyuleyici bir destinasyondur kesfinize almanyanin yeniden birlesmesinin sembolu olan brandenburg kapisindan baslayin bu gorkemli neoklasik anit sehrin kalbinde gururla durmakta ve muzeler saraylar ve buyuleyici kafelerle kapli tarihi bir bulvar olan unter den lindee acilan kapiyi olusturmaktadir brandenburg kapisinda gunun farkli saatlerinde dolasin ve donusturucu guzelligini deneyimleyin gun dogumunun sicak isiginda veya gece 