,'title',0,1,' munich 3909108 1280 '),(728,'title',0,2,' munich 3909108 1280 '),(728,'title',0,3,' munich 3909108 1280 '),(728,'title',0,4,' munich 3909108 1280 '),(728,'title',0,5,' munich 3909108 1280 '),(728,'title',0,6,' munich 3909108 1280 '),(728,'title',0,7,' munich 3909108 1280 '),(728,'title',0,8,' munich 3909108 1280 '),(728,'title',0,9,' munich 3909108 1280 '),(728,'title',0,10,' munich 3909108 1280 '),(728,'title',0,11,' munich 3909108 1280 '),(728,'title',0,12,' munich 3909108 1280 '),(728,'title',0,13,' munich 3909108 1280 '),(735,'field',10,7,' schloss nymphenburg '),(735,'field',10,8,' nymphenburg palace '),(735,'field',10,9,' palazzo di nymphenburg '),(735,'field',10,10,'   '),(735,'slug',0,7,''),(735,'slug',0,8,''),(735,'slug',0,9,''),(735,'slug',0,10,''),(736,'field',6,7,' muenchen ist ein synonym fuer das oktoberfest das groesste volksfest der welt das jedes jahr millionen von besuchern anlockt die stadt verwandelt sich in ein lebendiges fest der bayerischen kultur mit traditioneller musik koestlicher kueche und natuerlich dem besten bier ueber das oktoberfest hinaus bieten muenchens biergaerten wie das beruehmte hofbraeuhaus eine authentische verkostung der einheimischen biere und eine gesellige atmosphaere die die bayerische lebensart ausmacht die kulinarische landschaft muenchens ist ein gastronomisches abenteuer bei dem traditionelle bayerische gerichte durch internationale einfluesse ergaenzt werden von den deftigen wuerstchen auf dem viktualienmarkt bis hin zu den michelin sternerestaurants bietet die stadt alles was das herz begehrt verpassen sie nicht die gelegenheit eine brezn zu probieren oder sich ein stueck apfelstrudel zu goennen waehrend sie die stadt erkunden in muenchen verschmelzen vergangenheit und gegenwart und schaffen eine atmosphaere die sowohl bezaubernd als auch dynamisch ist ob sie ueber historische plaetze schlendern in kulturelle schaetze eintauchen oder in einem belebten biergarten einen krug heben muenchen laedt sie ein die harmonische mischung aus tradition kultur und festlicher stimmung zu erleben begleiten sie uns wenn wir die ecken und winkel dieses bayerischen wandteppichs erkunden wo jeder moment ein fest des zeitlosen reizes muenchens ist prost '),(736,'field',6,8,' munich is synonymous with oktoberfest the worls largest volksfest that attracts millions of visitors every year the city transforms into a lively celebration of bavarian culture complete with traditional music delicious cuisine and of course the finest beer beyond oktoberfest munichs beer gardens like the famous hofbrauhaus offer an authentic taste of local brews and a convivial atmosphere that defines the bavarian way of life munichs culinary landscape is a gastronomic adventure with traditional bavarian fare complemented by international influences from the hearty sausages of viktualienmarkt to the michelin starred restaurants the city caters to diverse palates dot miss the chance to savor a pretzel or indulge in a delectable slice of apfelstrudel while exploring the city in munich the past and present coalesce creating an atmosphere that is both enchanting and dynamic whether youre strolling through historic squares immersing yourself in cultural treasures or raising a stein in a bustling beer garden munich invites you to experience the harmonious blend of tradition culture and festive cheer join us as we explore the nooks and crannies of this bavarian tapestry where each moment is a celebration of munichs timeless allure prost '),(736,'field',6,9,' monaco di baviera e sinonimo di oktoberfest la piu grande festa popolare del mondo che attira ogni anno milioni di visitatori la citta si trasforma in una vivace celebrazione della cultura bavarese con musica tradizionale cucina deliziosa e naturalmente la migliore birra oltre aloktoberfest le birrerie alaperto di monaco come la famosa hofbrauhaus offrono un assaggio autentico delle birre locali e uatmosfera conviviale che definisce lo stile di vita bavarese il paesaggio culinario di monaco e uavventura gastronomica con piatti tradizionali bavaresi integrati da influenze internazionali dalle sostanziose salsicce del viktualienmarkt ai ristoranti stellati michelin la citta si rivolge a palati diversi non perdete occasione di assaporare un pretzel o di concedervi una deliziosa fetta di apfelstrudel mentre esplorate la citta a monaco di baviera passato e presente si fondono creando uatmosfera incantevole e dinamica che si tratti di passeggiare per le piazze storiche di immergersi nei tesori culturali o di innalzare uno stein in una vivace birreria alaperto monaco vi invita a sperimentare armoniosa miscela di tradizione cultura e allegria festosa unitevi a noi per esplorare gli angoli e le fessure di questo arazzo bavarese dove ogni momento e una celebrazione del fascino senza tempo di monaco prost '),(736,'field',6,10,'                                       hofbrauhaus                                viktualienmarkt                                                                                      '),(736,'slug',0,7,''),(736,'slug',0,8,''),(736,'slug',0,9,''),(736,'slug',0,10,''),(807,'alt',0,1,''),(807,'alt',0,2,''),(807,'alt',0,3,''),(807,'alt',0,4,''),(807,'alt',0,5,''),(807,'alt',0,6,''),(807,'alt',0,7,''),(807,'alt',0,8,''),(807,'alt',0,9,''),(807,'alt',0,10,''),(807,'alt',0,11,''),(807,'alt',0,12,''),(807,'alt',0,13,''),(807,'extension',0,1,' jpg '),(807,'extension',0,2,' jpg '),(807,'extension',0,3,' jpg '),(807,'extension',0,4,' jpg '),(807,'extension',0,5,' jpg '),(807,'extension',0,6,' jpg '),(807,'extension',0,7,' jpg '),(807,'extension',0,8,' jpg '),(807,'extension',0,9,' jpg '),(807,'extension',0,10,' jpg '),(807,'extension',0,11,' jpg '),(807,'extension',0,12,' jpg '),(807,'extension',0,13,' jpg '),(807,'field',5,1,' test '),(807,'field',5,2,' test '),(807,'field',5,3,' test '),(807,'field',5,4,' test '),(807,'field',5,5,' test '),(807,'field',5,6,' test '),(807,'field',5,7,' test '),(807,'field',5,8,' test '),