nsparenz der glasfassade schaffen eine einladende atmosphaere die besucher dazu einlaedt die reiche geschichte und die lebendige gegenwart der juedischen kultur zu entdecken die synagoge ist nicht nur ein religioeses zentrum sondern auch ein ort der begegnung und des interkulturellen austauschs die gemeinde organisiert regelmaessig veranstaltungen vortraege und kulturelle aktivitaeten die menschen unterschiedlicher hintergruende zusammenbringen besucher haben die moeglichkeit an fuehrungen teilzunehmen um mehr ueber die geschichte der juedischen gemeinschaft in muenchen zu erfahren und die bedeutung der synagoge als ort des gebets der bildung und des dialogs zu erleben die muenchener synagoge ist somit nicht nur ein architektonisches meisterwerk sondern auch ein lebendiges zeugnis fuer die vielfalt und offenheit der stadt '),(831,'field',6,8,' the munich synagogue an architectural jewel in the heart of the bavarian capital shines as a symbol of the jewish community and its cultural heritage the synagogue was inaugurated in 2006 and impresses with its modern aesthetics which are nevertheless deeply rooted in history and tradition the building designed by renowned architects wandel hoefer lorch hirsch harmoniously combines elements of judaism with contemporary design the clean lines and transparency of the glass facade create an inviting atmosphere that invites visitors to discover the rich history and vibrant present of jewish culture the synagogue is not only a religious center but also a place of encounter and intercultural exchange the community regularly organizes events lectures and cultural activities that bring people from different backgrounds together visitors have the opportunity to take part in guided tours to learn more about the history of the jewish community in munich and experience the importance of the synagogue as a place of prayer education and dialog the munich synagogue is therefore not only an architectural masterpiece but also a living testimony to the diversity and openness of the city '),(831,'field',6,9,' la sinagoga di monaco gioiello architettonico nel centro della capitale bavarese brilla come simbolo della comunita ebraica e del suo patrimonio culturale inaugurata nel 2006 la sinagoga colpisce per la sua estetica moderna ma profondamente radicata nella storia e nella tradizione edificio progettato dai famosi architetti wandel hoefer lorch hirsch combina armoniosamente elementi delebraismo con il design contemporaneo le linee pulite e la trasparenza della facciata in vetro creano uatmosfera invitante che invita i visitatori a scoprire la ricca storia e il vibrante presente della cultura ebraica la sinagoga non e solo un centro religioso ma anche un luogo di incontro e scambio interculturale la comunita organizza regolarmente eventi conferenze e attivita culturali che riuniscono persone di diversa provenienza i visitatori hanno la possibilita di partecipare a visite guidate per conoscere meglio la storia della comunita ebraica di monaco e sperimentare importanza della sinagoga come luogo di preghiera educazione e dialogo la sinagoga di monaco non e quindi solo un capolavoro architettonico ma anche una testimonianza vivente della diversita e delapertura della citta '),(831,'field',6,10,'                    2006                                                                                                                         '),(831,'slug',0,7,''),(831,'slug',0,8,''),(831,'slug',0,9,''),(831,'slug',0,10,''),(846,'field',2,7,' muenchen die pulsierende bayerische hauptstadt ist nicht nur fuer ihre lebendige bierkultur und praechtigen bauten bekannt sondern beherbergt auch eine beeindruckende vielfalt an museen die kunst geschichte und wissenschaft auf faszinierende weise praesentieren tauchen wir ein in die reiche kulturlandschaft muenchens und entdecken die besten museen die einen besuch definitiv lohnen alte pinakothek meisterwerke der europaeischen malerei die alte pinakothek zaehlt zu den aeltes