euchten das juedische museum fungiert nicht nur als ort der ausstellung sondern auch als lebendiges zentrum fuer kulturelle veranstaltungen waehrend der nacht koennen die besucher an vortraegen konzerten und workshops teilnehmen '),(1049,'field',2,8,' munich a city rich in history and culture opens its doors for a fascinating long night of museums among the many outstanding institutions opening their doors on this special evening the deutsches museum and the jewish museum play a prominent role les immerse ourselves in the cultural diversity and captivating experiences offered by these two museums deutsches museum a journey through the history of technology the deutsches museum the worls largest museum of science and technology offers visitors a fascinating journey through the history of technology from steam engines to modern space technologies the exhibition spans several areas the long night of museums allows visitors to immerse themselves in the fascinating world of innovation at the heart of the deutsches museum is an impressive planetarium that invites visitors on a journey through the stars during the long night special shows are presented that explore the night sky over munich and beyond jewish museum munich a journey through culture and history the jewish museum munich is dedicated to exploring the history and culture of the jewish community in munich during the long night of museums the museum becomes a place for encounters and intercultural exchange during the long night temporary exhibitions are often presented that highlight various aspects of jewish art history and traditions the jewish museum functions not only as an exhibition venue but also as a lively center for cultural events during the night visitors can take part in lectures concerts and workshops '),(1049,'field',2,9,' monaco di baviera citta ricca di storia e cultura apre le sue porte per uaffascinante lunga notte dei musei tra le molte istituzioni di spicco che aprono le loro porte in questa 